01-20 09:34:36'),(59,'App\\Commodity',14,3,'name','Pili',1,'2021-01-20 09:38:51','2021-01-20 09:38:51'),(60,'App\\Commodity',10,3,'name','Banana',1,'2021-01-20 09:39:20','2021-01-20 09:39:20'),(61,'App\\Commodity',22,3,'name','Rootcrop - Sweet Potato',1,'2021-01-20 09:41:34','2021-01-20 09:41:34'),(62,'App\\Commodity',3,3,'name','Tropical Fruit - Jackfruit',1,'2021-01-20 09:42:42','2021-01-20 09:42:42'),(63,'App\\Technology',4,3,'applicability_location','Region 2',1,'2021-01-20 10:16:50','2021-01-20 10:16:50'),(64,'App\\Technology',4,3,'user_id','3',1,'2021-01-20 10:16:50','2021-01-20 10:16:50'),(65,'App\\Technology',4,3,'basic_research_title','Project 2. Development of improved goat semen extenders and AI delivery system in Region 2',1,'2021-01-20 10:59:30','2021-01-20 10:59:30'),(66,'App\\Technology',4,3,'basic_research_funding','DOST-PCAARRD',1,'2021-01-20 10:59:30','2021-01-20 10:59:30'),(67,'App\\Technology',4,3,'basic_research_implementing','Isabela State University (ISU)',1,'2021-01-20 10:59:30','2021-01-20 10:59:30'),(68,'App\\Technology',4,3,'title','Goat Semen Processing Using Soy-Bean Lecithin-Based Extender',1,'2021-01-20 11:28:58','2021-01-20 11:28:58'),(69,'App\\Technology',4,3,'banner','600813fa3b2d9semex2.jpg',1,'2021-01-20 11:28:58','2021-01-20 11:28:58'),(70,'App\\Technology',4,3,'commercialization_mode','Licensing Agreement',1,'2021-01-20 11:34:12','2021-01-20 11:34:12'),(71,'App\\Technology',4,3,'description','The semen extender formulation used in processing goat semen is composed of buffer solution, non-penetrating cryoprotectant, and penetrating cryoprotectant. This new formulation is proven effective in lengthening the viability of the goat spermatozoa under refrigerated storage from 48 to 110 hours or in increasing viability of frozen sperm cells from 30 to 70% post-thaw motility.',1,'2021-01-20 11:37:18','2021-01-20 11:37:18'),(72,'App\\Technology',5,3,'user_id','3',1,'2021-01-20 12:09:59','2021-01-20 12:09:59'),(73,'App\\Technology',5,3,'banner','60081d979b5c1bunga dewormer.jpg',1,'2021-01-20 12:09:59','2021-01-20 12:09:59'),(74,'App\\Technology',5,3,'title','Process of Preparing Betel Nut (Areca catechu) Deworming Composition for Chickens',1,'2021-01-20 12:17:09','2021-01-20 12:17:09'),(75,'App\\Technology',5,3,'description','The technology relates to the process for preparing the anthelmintic or deworming composition for chicken comprised of seeds of betel nut (Areca catechu) in powder form. The main component, Areca catechu or betel nut or Bunga is a species of palm grown mainly in Asian countries, like the Philippines for seed crop. The chemical constituents of A. Catechu have been investigated for, among others, anti-nematicidal/helmintic. The seed contains several alkaloids belonging to the pyridine group. The most important of them physiologically is arecoline (Chu, 2001), which is known and used medicinally as anthelmintic. Based on studies, betel nut anthelmintics are comparable to the expensive commercial dewormers in terms of efficacy. It is also cheaper in terms of cost.',1,'2021-01-20 12:17:09','2021-01-20 12:17:09'),(76,'App\\Technology',5,3,'significance','The technology is a simple and effective process for producing an effective anthelmintic against egg and adult parasites, in particular roundworms and tapeworms.',1,'2021-01-20 12:17:09','2021-01-20 12:17:09'),(77,'App\\Technology',5,3,'target_users','Poultry Growers',1,'2021-01-20 12:17:09','2021-01-20 12:17:09'),(78,'App\\Technology',5,3,'applicability_location','Region 6',1,'2021-01-20 12:17:09','2021-01-20 12:17:09'),(79,'App\\TechnologyCategory',5,3,'name','Commodity by-product utilization or waste treatment',1,'2021-01-20 12:18:09','2021-01-20 12:18:09'),(80,'App\\Technology',5,3,'basic_research_title','Botanical Dewormer for Free Range Native Chicken',1,'2021-01-20 12:30:29','2021-01-20 12:30:29'),(81,'App\\Technology',5,3,'basic_research_funding','DOST-GIA',1,'2021-01-20 12:30:29','2021-01-20 12:30:29'),(82,'App\\Technology',5,3,'basic_research_implementing','Capiz State University (CapSU)',1,'2021-01-20 12:30:29','2021-01-20 12:30:29'),(83,'App\\Technology',5,3,'basic_research_cost','2024881.28',1,'2021-01-20 12:30:29','2021-01-20 12:30:30'),(84,'App\\Technology',5,3,'basic_research_start_date','2016-03-01',1,'2021-01-20 12:30:29','2021-01-20 12:30:30'),(85,'App\\Technology',5,3,'basic_research_end_date','2017-05-31',1,'2021-01-20 12:30:29','2021-01-20 12:30:30'),(86,'App\\Technology',5,3,'commercialization_mode',NULL,1,'2021-01-20 12:32:14','2021-01-20 12:32:14'),(87,'App\\Technology',5,3,'commercialization_mode','Spin-Off',1,'2021-01-20 12:47:50','2021-01-20 12:47:50'),(88,'App\\Technology',6,3,'title','Process of Preparing Papaya (Carica papaya L.) Deworming Composition for Chickens',1,'2021-01-20 12:57:10','2021-01-20 12:57:10'),(89,'App\\Technology',6,3,'user_id','3',1,'2021-01-20 12:57:10','2021-01-20 12:57:11'),(90,'App\\Technology',6,3,'significance','The technology is a simple and effective process for producing an anthelmintic from papaya, a commonly found plant in the Philippines and a species investigated and found effective as anti-nematicidallhelmintic against roundworms.',1,'2021-01-20 13:12:41','2021-01-20 13:12:41'),(91,'App\\Technology',6,3,'target_users','Poultry Farmers',1,'2021-01-20 13:12:41','2021-01-20 13:12:41'),(92,'App\\Technology',6,3,'applicability_location','Region 6',1,'2021-01-20 13:12:41','2021-01-20 13:12:41'),(93,'App\\Technology',5,3,'applicability_industry','3',1,'2021-01-20 13:13:27','2021-01-20 13:13:27'),(94,'App\\Technology',5,3,'title','Ethnobotanical Dewormers for Chickens',1,'2021-01-20 13:34:16','2021-01-20 13:34:16'),(95,'App\\Technology',5,3,'description','The technology relates to the process for preparing the anthelmintic or deworming composition for chicken comprised of seeds of papaya (carica papaya), ipil-ipil (Leucaena leucocephala), and betel nut (Areca catechu) seeds in powder form. The technology is an economical and an alternative way to reduce the parasitic burden to tolarable level through a simple and effective process for producing an effective anthelmintic against egg and adult parasites. The anthelmintic produced through this process is a cheap source of anthelmintics to complement the commercially manufactures parasitic drugs against internal parasitism. The control of parasitic diseases will lead to the stable supply of native chickens and alleviate poverty in the countryside.',1,'2021-01-20 13:34:16','2021-01-20 13:34:16'),(96,'App\\Technology',5,3,'year_developed','2014',1,'2021-01-20 13:34:16','2021-01-20 13:34:16'),(97,'App\\Technology',5,3,'banner','6008320e2bcc1dewormer.jpg',1,'2021-01-20 13:37:18','2021-01-20 13:37:18'),(98,'App\\Technology',5,3,'description','The technology relates to the process for preparing the anthelmintic or deworming composition for chicken comprised of seeds of papaya (Carica papaya), ipil-ipil (Leucaena leucocephala), and betel nut (Areca catechu) seeds in powder form. These plants contain constituents that serve as cheap sources of anthelmintics against internal parasitism. Internal parasitism in native chickens can cause severe diarrhea and high mortality. The formulation can be used for the treatment and control of roundworms, including common large roundworms of native chicken (Ascaridia galli), common threadworms (Capillaria specie), the cecal worm (Heterakis gallinarum) and gapeworm (Syngamus trachea). The technology is an economical and an alternative way to reduce the parasitic burden to a tolerable level through a simple and effective process for producing an effective anthelmintic against egg and adult parasites. The anthelmintic produced through this process is a cheap source of anthelmintics to complement the commercially manufactures parasitic drugs against internal parasitism. The control of parasitic diseases will lead to a stable supply of native chickens and alleviate poverty in the countryside. This technology has six approved intellectual property rights, all under the Utility Model classification for the process and composition of dewormer.',1,'2021-01-20 13:49:12','2021-01-20 13:49:12'),(99,'App\\Technology',7,3,'user_id','3',1,'2021-01-20 14:02:16','2021-01-20 14:02:16'),(100,'App\\Technology',7,3,'banner','600837e871496nutrio.jpg',1,'2021-01-20 14:02:16','2021-01-20 14:02:16'),(101,'App\\Technology',7,3,'significance','Nutrio® Biofertilizer is a foliar spray that promotes plant growth of sugarcane. This environment-friendly plant supplement does not only improve the sugarcane but also other food crops such as eggplant and has a potential for increasing yield by 10 to 15%.',1,'2021-01-20 14:04:44','2021-01-20 14:04:44'),(102,'App\\Technology',7,3,'target_users','Sugarcane Farmers',1,'2021-01-20 14:04:44','2021-01-20 14:04:44'),(103,'App\\Technology',7,3,'applicability_location','Region 4A',1,'2021-01-20 14:04:44','2021-01-20 14:04:44'),(104,'App\\Technology',7,3,'applicability_industry','4',1,'2021-01-20 14:05:34','2021-01-20 14:05:34'),(105,'App\\Technology',7,3,'year_developed','2015',1,'2021-01-20 14:05:34','2021-01-20 14:05:34'),(106,'App\\Technology',7,3,'commercialization_mode',NULL,1,'2021-01-20 14:06:26','2021-01-20 14:06:26'),(107,'App\\Technology',7,3,'description','Nutrio® Biofertilizer, a new foliar spray biofertilizer inoculant contains endophytic bacteria (Enterobacter sacchari S18 ), a Nitrogen-fixing organism that has been isolated, screened, and tested for improved growth and yield of sugarcane. Nutrio offers a cheap, sustainable, and organic supplement to reduce the use of chemical fertilizers.',1,'2021-01-20 14:14:48','2021-01-20 14:14:48'),(108,'App\\Agency',3,3,'phone','+63 78 305 9013',1,'2021-01-20 14:18:04','2021-01-20 14:18:04'),(109,'App\\Agency',4,3,'phone','+63 36 651 0085',1,'2021-01-20 14:18:20','2021-01-20 14:18:20'),(110,'App\\Agency',3,3,'district','6th District',1,'2021-01-20 14:18:52','2021-01-20 14:18:52'),(111,'App\\Agency',5,3,'name','University of the