0e2a59d20efpeanut sheller-sorter.jpg',1,'2021-01-25 02:18:01','2021-01-25 02:18:01'),(182,'App\\Technology',11,3,'applicability_industry','6',1,'2021-01-25 02:21:33','2021-01-25 02:21:33'),(183,'App\\Technology',11,3,'commercialization_mode',NULL,1,'2021-01-25 02:21:33','2021-01-25 02:21:34'),(184,'App\\Technology',11,3,'title','Peanut Sheller-Sorter',1,'2021-01-25 02:35:56','2021-01-25 02:35:56'),(185,'App\\Technology',14,3,'title','Protein Enriched Copra Meal (PECM) as Feed for Swine and Poultry',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(186,'App\\Technology',14,3,'significance','The protein-enriched copra meal (PECM) is used as a substrate in the incorporation of multi-stained probiotics to enhance/improve overall animal health. This ensures low cost in feed formulation as supplements are included in the protein ingredient.',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(187,'App\\Technology',14,3,'target_users','Swine and Poultry Farmers',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(188,'App\\Technology',14,3,'applicability_industry','3',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(189,'App\\Technology',14,3,'year_developed','2015',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(190,'App\\Technology',14,3,'user_id','3',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(191,'App\\Technology',14,3,'banner','600e30fa12d71PECM banner.jpg',1,'2021-01-25 02:46:18','2021-01-25 02:46:18'),(192,'App\\Technology',14,3,'description','Through solid-state fermentation technology, the PECM is enriched with microorganisms that increase the protein content of copra meal, which is normally high in fiber but low in nutrients. PECM is seen to replace 40 to 50 percent of the soybean contained in animal feed. The PECM uses waste products from coconut oil.',1,'2021-01-25 02:52:01','2021-01-25 02:52:01'),(193,'App\\Technology',14,3,'is_invention','1',1,'2021-01-25 02:57:22','2021-01-25 02:57:22'),(194,'App\\Technology',14,3,'basic_research_title','Protein Enrichment of Copra Meal as Feed for Swine and Poultry',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(195,'App\\Technology',14,3,'basic_research_funding','DOST-PCAARRD',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(196,'App\\Technology',14,3,'basic_research_implementing','University of the Philippines Los Baños',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(197,'App\\Technology',14,3,'basic_research_cost','7477285.98',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(198,'App\\Technology',14,3,'basic_research_start_date','2012-06-01',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(199,'App\\Technology',14,3,'basic_research_end_date','2015-05-31',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(200,'App\\Technology',14,3,'applied_research_type','Pilot testing',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(201,'App\\Technology',14,3,'applied_research_title','Pilot testing of protein enriched copra meal (PECM): A valuable protein feed ingredient for swine and poultry',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(202,'App\\Technology',14,3,'applied_research_funding','DOST-PCAARRD',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(203,'App\\Technology',14,3,'applied_research_implementing','University of the Philippines Los Baños',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(204,'App\\Technology',14,3,'applied_research_cost','21586267.00',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(205,'App\\Technology',14,3,'applied_research_start_date','2014-07-01',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(206,'App\\Technology',14,3,'applied_research_end_date','2017-06-30',1,'2021-01-25 03:03:44','2021-01-25 03:03:44'),(207,'App\\Technology',15,3,'description','Loop-Mediated Isothermal Amplification (LAMP) diagnostic kit is a practical alternative to the conventional polymerase chain reaction (PCR) and standard microbiological techniques in the detection of White Spot Syndrome Virus (WSSV). It is 10x more sensitive for the detection of WSSV compared to PCR. It is aided by a heat block apparatus that replaces the expensive thermal cycler. Results can also be obtained within 1 hour. Due to its convenience, simplicity and speed of detection, it can be used on-site. Diagnostic kits utilizing locally fabricated machines will significantly bring down the cost of pathogen detection in the country.\r\n\r\nDiagnostic kits based on LAMP that are being developed for the detection of WSSV will have tremendous and significant commercial application in the culture of shrimps in the Philippines (and eventually to other shrimp producing countries) because of the following reasons: 1) they are easy to use, 2) the manner of detecting the target pathogen is done visually, 3) significantly high number of times a detection can be made during the culture because they are cheap, 4) they are highly sensitive and accurate in detecting the causative agent, 5) they can be within the purchasing capacity of resource-limited localities and 6) new assays based on this concept may be designed for other pathogens. As a result, these kits will have a target market in shrimp farming regions that are located in resource-limited areas, where access to sophisticated equipment in detecting WSSV is a major issue. Considering the number of shrimp farms in the Philippines, the shrimp hatcheries and shrimp health laboratories in the country, the production of this LAMP diagnostic kit will have good market potential.',1,'2021-01-25 03:21:00','2021-01-25 03:21:00'),(208,'App\\Technology',15,3,'significance','A diagnostic system, consisting of a set of premixed solutions for DNA assay and a heating block, which provides a method to detect a target pathogen, e.g., bacteria or viruses, by amplification of a target sequence at isothermal conditions for at least 1 hour.',1,'2021-01-25 03:21:00','2021-01-25 03:21:00'),(209,'App\\Technology',15,3,'user_id','3',1,'2021-01-25 03:21:00','2021-01-25 03:21:00'),(210,'App\\Technology',15,3,'banner','600e3b68e748cJAmp banner.jpg',1,'2021-01-25 03:30:48','