INSERT INTO `technologies` VALUES (1,'2020-10-12 12:19:03','2021-11-09 07:48:34','Use of tissue-cultured planting materials for chrysanthemum','This is used to ensure the health standard off planting materials. The shoot-tips are cut from the apical shoots of a healthy chrysanthemum plants and inoculated in sterilized bottles containing the culture media. When shoots have developed into plantlets, these are taken out from the laboratory into the greenhouse for acclimatization and hardening, to increase rate of survival and reduce mortality before transplanting.','This is used to ensure the health standard of planting materials.','Chrysanthemum growers','CAR','Licensing Agreement',2018,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'60112e9fafbf1chrysanthemum.JPG'),(4,'2020-10-12 13:52:23','2021-02-04 17:09:26','Goat Semen Processing Using Soy-Bean Lecithin-Based Extender','The semen extender formulation used in processing goat semen is composed of buffer solution, non-penetrating cryoprotectant, and penetrating cryoprotectant. This new formulation is proven effective in lengthening the viability of the goat spermatozoa under refrigerated storage from 48 to 110 hours or in increasing viability of frozen sperm cells from 30 to 70% post-thaw motility.','Improved formulation for processing goat semen','Goat Raisers','Region 2','Licensing Agreement',2016,0,0,1,2,NULL,'Project 2. Development of improved goat semen extenders and AI delivery system in Region 2','DOST-PCAARRD','Isabela State University (ISU)',0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'6008fd9f4a711semex2.jpg'),(5,'2020-10-12 14:32:55','2021-02-04 17:09:42','Ethnobotanical Dewormers for Chickens','The technology relates to the process for preparing the anthelmintic or deworming composition for chicken comprised of seeds of papaya (Carica papaya), ipil-ipil (Leucaena leucocephala), and betel nut (Areca catechu) seeds in powder form. These plants contain constituents that serve as cheap sources of anthelmintics against internal parasitism. Internal parasitism in native chickens can cause severe diarrhea and high mortality. The formulation can be used for the treatment and control of roundworms, including common large roundworms of native chicken (Ascaridia galli), common threadworms (Capillaria specie), the cecal worm (Heterakis gallinarum) and gapeworm (Syngamus trachea). The technology is an economical and an alternative way to reduce the parasitic burden to a tolerable level through a simple and effective process for producing an effective anthelmintic against egg and adult parasites. The anthelmintic produced through this process is a cheap source of anthelmintics to complement the commercially manufactures parasitic drugs against internal parasitism. The control of parasitic diseases will lead to a stable supply of native chickens and alleviate poverty in the countryside. This technology has ten approved intellectual property rights, all under the Utility Model classification for the process and composition of dewormer.','The technology is a simple and effective process for producing an effective anthelmintic against egg and adult parasites, in particular roundworms and tapeworms.','Poultry Growers','Region 6','Spin-Off',2014,0,0,1,2,NULL,'Botanical Dewormer for Free Range Native Chicken','DOST-GIA','Capiz State University (CapSU)',2024881.28,'2016-03-01','2017-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'6008fdbb42c52dewormer.jpg'),(7,'2020-10-12 14:51:05','2021-02-04 17:10:19','Nutrio Biofertilizer for Eggplant and Sugarcane','Nutrio® Biofertilizer, a new foliar spray biofertilizer inoculant contains endophytic bacteria (Enterobacter sacchari S18 ), a Nitrogen-fixing organism that has been isolated, screened, and tested for improved growth and yield of sugarcane. Nutrio offers a cheap, sustainable, and organic supplement to reduce the use of chemical fertilizers.','Nutrio® Biofertilizer is a foliar spray that promotes plant growth of sugarcane. This environment-friendly plant supplement does not only improve the sugarcane but also other food crops such as eggplant and has a potential for increasing yield by 10 to 15%.','Sugarcane Farmers','Region 4A',NULL,2015,0,1,1,2,NULL,'Project 2. Development and Field Testing of Endophytic Bacterial Inoculant as New Biofertilizers for Eggplant (Solanum melongena) and Sugarcane (Saccharum officinarum L.)','DOST-PCAARRD','University of the Philippines Los Baños',1362600.00,'2012-06-01','2015-05-31','Field testing','Toxicological Study and Pilot Testing of Nutrio™ Biofertilizer for Improved Production of Sugarcane in Regions III and VI','DOST-PCAARD','University of the Philippines Los Baños',5000000.00,'2017-11-16','2020-05-15',NULL,NULL,'6008fdd6dacf4nutrio.jpg'),(8,'2020-10-12 14:51:32','2021-02-04 17:10:32','Rice Harvester Attachment (System of Assembling a Combined Harvester and Thresher attachment to Hand Tractor and the Apparatus Therefrom)','An efficient rice harvesting implement that can be readily mounted to and dismounted  from the hand tractor unit thus, increasing the utilization of handtractor and helps reduce labor cost. It has an estimated capacity of 0.5 ha/day for an eight-hour operation.','This is an assembly of combined harvester and thresher attachments that can easily mounted and removed from a hand tractor.','Rice farmers','NCR',NULL,2017,0,1,1,2,NULL,'Project 3. Design and development of handtractor attachment (harvester and transplanter)','DOST-PCAARRD','Department of Science and Technology - Metals Industry Research and Development Center (DOST-MIRDC)',3542653.00,'2013-07-01','2016-03-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'6008fdec24747harvester.jpg'),(9,'2020-10-19 13:02:49','2021-02-04 17:10:42','Carrageenan Plant Growth Promoter','Carrageenan is an indigestible polysaccharide (carbohydrates) extracted from edible seaweeds.  Polysaccharide, when subjected to modified irradiation technology, can be an effective plant growth supplement. At a very small dose, this supplement makes an effective organic fertilizer.  It has been found to increase rice yield by 15-30%. The application of three and six bags of chemical fertilizer per ha, combined with 20 ml/L of carrageenan yields higher grain weight (450g and 455 g/10 hills, respectively) than the farmers\' practice of applying nine bags of chemical fertilizer/ha.  Carrageenan enhances the crop vigor of rice. Productive tillers and panicle length (length of inflorescence) are significantly higher in Carrageenan-treated plants. Productive tillers are the rice stems that bear panicles (rice inflorescence) with fertilized grains, while longer rice panicle is associated with producing more grains.','Carrageenan is an indigestible polysaccharide (carbohydrates) extracted from edible seaweeds.  Polysaccharide, when subjected to modified irradiation technology, can be an effective plant growth supplement. At a very small dose, this supplement makes an effective organic fertilizer.  It has been found to increase rice yield by 15-30%.','Rice Farmers','NCR','Licensing Agreement',2015,0,1,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'60090b8ac0511Carrageenan.jpg'),(10,'2020-10-19 13:06:22','2021-02-04 17:10:58','Pelletizing Machine for Goat Feeds (Forage-Based Pellets for Dairy Goat)','A portable pellet mill developed mainly from scrap-materials that is appropriate for on-farm pellet production.  It is used in pelletizing total mixed ration (TMR) for goats.  It has a milling capacity of 130 kg/hr and machine efficiency of 93.30% with fuel consumption of 0.17 liters/hr.','A portable pellet mill developed mainly from scrap-materials that is appropriate for on-farm pellet production.','Goat farmers','Region 3','Licensing Agreement',2017,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'600a7ffcdeaf4portable pellet machine.jpg'),(11,'2020-10-19 13:07:08','2021-02-04 17:11:14','Peanut Sheller-Sorter','The peanut sheller-sorter is an electric motor powered machine that is used to break peanut pods through centrifugal and impact force action. It separates the freed-up kernels from the peanut shells. Furthermore, it cleans and sorts kernels into two sizes. It has a processing capacity of about 150 kg/hour of peanuts.','A peanut sheller with sorter machine to separate the peanut kernel from pods and sort the kernels into three sizes.','Peanut farmers','Region 2',NULL,2003,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'600e450c9ae50peanut sheller-sorter.jpg'),(12,'2021-01-20 04:07:02','2021-10-18 06:27:21','SPATHOGLOTTIS KARYOTYPING OF MITOTIC CHROMOSOMES (PROCESS FOR KARYOTYPING MITOTIC CHROMOSOMES OF SPATHOGLOTTIS SPP. AND OTHER ORCHIDS)','THE PRESENT UTILITY MODEL RELATES TO AN HERBAL DEWORMER COMPOSITION FOR SMALL RUMINANTS, SUCH AS GOATS, THAT CAN CONTROL PARASITIC INFECTION CAUSED BY STRONGYLE WORM (HAEMONCHUS CONTORTUS). THE COMPOSITION IS A MIXTURE OF CRUDE ETHANOLIC EXTRACTS (CEES) FROM MAKABUHAY (TINOSPORA RUMPHII), CAIMITO (CHRYSOPHYLLUM CAINITO), AND MAKAHIYA (MIMOSA PUDICA).',NULL,NULL,'NCR',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(13,'2021-01-20 04:08:48','2021-10-18 06:27:21','ETHNOBOTANICAL ANTHELMINTIC FOR FREE RANGE NATIVE CHICKEN ( ETHNOBOTANICAL DEWORMER COMPOSITION FOR NATIVE CHICKEN)','This model presents a composition for an ethnobotanical dewormer for native chicken using the powder forms of mature seeds of betel nut (Areca catechu) and ipil-ipil (Leucaena lecocephala) as main ingredients. These plants contain constituents that serve as cheap sources of anthelmintics against internal parasitism. Internal parasitism in native chicken can cause severe diarrhea and high mortality. The formulation can be used for the treatment and control of roundworms, including common large roundworms of native chicken (Ascaridia galli), common thread worms (Capillaria specie), and the cecal worm (Heterakis gallinarum) and gape worm (Syngamus trachea).',NULL,NULL,'Region 6',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(14,'2021-01-20 04:10:10','2021-02-04 17:11:27','Protein Enriched Copra Meal (PECM) as Feed for Swine and Poultry','Through solid-state fermentation technology, the PECM is enriched with microorganisms that increase the protein content of copra meal, which is normally high in fiber but low in nutrients. PECM is seen to replace 40 to 50 percent of the soybean contained in animal feed. The PECM uses waste products from coconut oil.','The protein-enriched copra meal (PECM) is used as a substrate in the incorporation of multi-stained probiotics to enhance/improve overall animal health. This ensures low cost in feed formulation as supplements are included in the protein ingredient.','Swine and Poultry Farmers','Region 4A',NULL,2015,0,1,1,2,NULL,'Protein Enrichment of Copra Meal as Feed for Swine and Poultry','DOST-PCAARRD','University of the Philippines Los Baños',7477285.98,'2012-06-01','2015-05-31','Pilot testing','Pilot testing of protein enriched copra meal (PECM): A valuable protein feed ingredient for swine and poultry','DOST-PCAARRD','University of the Philippines Los Baños',21586267.00,'2014-07-01','2017-06-30',NULL,NULL,'600e30fa12d71PECM banner.jpg'),(15,'2021-01-20 04:11:08','2021-02-04 17:11:47','JAmp© Juan Amplification WSSV Detection Kit (Old name: LAMP Kit for Shrimp Pathogens)','Loop-Mediated Isothermal Amplification (LAMP) diagnostic kit is a practical alternative to the conventional polymerase chain reaction (PCR) and standard microbiological techniques in the detection of White Spot Syndrome Virus (WSSV). It is 10x more sensitive for the detection of WSSV compared to PCR. It is aided by a heat block apparatus that replaces the expensive thermal cycler. Results can also be obtained within 1 hour. Due to its convenience, simplicity and speed of detection, it can be used on-site. Diagnostic kits utilizing locally fabricated machines will significantly bring down the cost of pathogen detection in the country.\r\n\r\nDiagnostic kits based on LAMP that are being developed for the detection of WSSV will have tremendous and significant commercial application in the culture of shrimps in the Philippines (and eventually to other shrimp producing countries) because of the following reasons: 1) they are easy to use, 2) the manner of detecting the target pathogen is done visually, 3) significantly high number of times a detection can be made during the culture because they are cheap, 4) they are highly sensitive and accurate in detecting the causative agent, 5) they can be within the purchasing capacity of resource-limited localities and 6) new assays based on this concept may be designed for other pathogens. As a result, these kits will have a target market in shrimp farming regions that are located in resource-limited areas, where access to sophisticated equipment in detecting WSSV is a major issue. Considering the number of shrimp farms in the Philippines, the shrimp hatcheries and shrimp health laboratories in the country, the production of this LAMP diagnostic kit will have good market potential.','A diagnostic system, consisting of a set of premixed solutions for DNA assay and a heating block, which provides a method to detect a target pathogen, e.g., bacteria or viruses, by amplification of a target sequence at isothermal conditions for at least 1 hour.','Shrimp Farmers','NCR','Licensing Agreement',2013,0,1,1,2,NULL,'Project 7. Pathology and Development of Molecular Detection Kits for EMS/AHPND causing Bacteria','DOST-PCAARRD','University of Santo Tomas (UST)',10088184.00,'2015-07-01','2017-09-30','Field testing','Field Testing of LAMP Detection Kit for AHPND in Shrimps','DOST-PCAARRD','University of Santo Tomas (UST)',4999996.00,'2019-05-01','2021-08-31',NULL,NULL,'600e3b68e748cJAmp banner.jpg'),(16,'2021-01-20 04:11:50','2021-02-04 17:12:00','Far-Infrared Grain Dryer','A far-infrared radiation dryer comprising a grain elevator, a paddy hopper adapted to provide grains to said grain elevator, a far-infrared radiation slab disposed on top of said grain elevator, a rice husk gasifier adapted to provide hot flue gas to said far-infrared radiation slab wherein said far-infrared radiation slab is made of lahar cement, said grain elevator is provided with a suction blower and said grain elevator is also provided with an oscillating tray.','Far-Infrared (FIR) Grain Dryer is expected to increase your revenue due to its increased milling recovery which is 5-7%. It also reduces post-harvest loss by 5%.','Rice Farmers','Region 3',NULL,NULL,0,0,1,2,NULL,'Project 5. Development and pilot testing of a combined conduction and far infrared radiation paddy dryer','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice)',5913388.00,'2013-07-01','2016-12-31','Pilot testing','Pilot Testing of Combined Conduction and Far Infrared Radiation Dryer','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice)',4997557.00,'2017-10-01','2020-12-31',NULL,NULL,'600e65d2ded8dFIR grain dryer banner.jpg'),(17,'2021-01-20 04:12:41','2021-10-18 06:27:24','Local Riding-type Rice Transplanter','Suitable for transplanting inbred and hybrid rice. It can transplant 2 to 6 seedlings per hill at a planting depth of 2-6 cm, hill spacing of 12-18 cm, and row spacing of 30 cm. Helps minimize labor cost compared to manual transplanting, which requires 20-25 persons/day/ha and takes only two persons to complete transplanting activities and has a planting capacity of 2 ha/day with 24 hills/m2 planting density.',NULL,'Rice Farmers','Region 3',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(18,'2021-01-20 04:13:31','2021-10-18 06:27:17','Hi-Yeast Biocontrol Agent for Fruits and Vegetables','Hi YEAST is a yeast-based biocontrol agent  that prevents fruit and vegetable decay caused by pathogens during postharvest handling. The technology is designed as an alternative and/or supplement to reduce the use of chemicals in nature. Consequently, it will reduce human health and environmental risks that comes with the use of existing synthetic control agents. It is applicable to fruits and vegetables, specifically, to banana, tomato, calamansi, mango, garlic, nuts and onion.',NULL,NULL,'Region 4A',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(19,'2021-01-20 04:14:11','2021-10-18 06:27:25','Aerated Bulk Storage System for Peanut','The automated aerated bulk storage system for peanut pods can operate independently without being attended to by a microcontroller programmed to respond intelligently through a customized computer program. It maintains temperature and moisture levels of bulk store and preserves the viability of the peanuts, and keeps the moulds infestation low over time.',NULL,NULL,'Region 2',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(20,'2021-01-20 04:14:43','2021-10-18 06:27:32','Ride-on Precision Seeder for Wet Direct Seeding (Old name: Riding-type, self propelled rice seeder)','The machine is a local 8-row riding-type precision seeder that can have a seeding rate of 15kg/ha to 30 kg/ha and at least 2 ha/day field capacity and suitable both for hybrid and inbred rice production.',NULL,NULL,'Region 3',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(21,'2021-01-20 04:15:39','2021-10-18 06:27:29','FertigroeTM Controlled-Release Fertilizer','Controlled-release nitrogen fertilizer (CRNF) aims to replace conventional fertilizer and to reduce the cost of farming. The technology utilized the inherent properties of nanofertilizer, such as controlled release of nitrogen and greater surface area for higher absorption rate. Since CRNF can fully replace conventional fertilizers, the input cost of farming can be minimized. Reduced amount in comparison with conventional fertilizers (up to 50% reduction) will be needed to acquire targeted plant development when CRNF is used.',NULL,NULL,'Region 4A',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(22,'2021-01-20 04:16:20','2021-10-18 06:27:27','Chevon Valley Canned Products (Kalderetang Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 2',NULL,NULL,0,0,1,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(23,'2021-08-02 01:09:07','2021-08-02 01:37:23','Goat Semen Extender using Soy-Bean Lecithin-Based Extender','The formulation produced is a refinement to the existing goat semen extender intended for artificial insemination. Goat sperm cell is characterized as unique to the other livestock sperm cells, in terms of its reaction to the egg yolk. Semen diluents used in processing commonly contain egg yolk as a protection against cold and freezing related damages to the sperm cells. This utility model is comprise of buffer solution, non-penetrating cryoprotectant and penetrating cryoprotectant. The non-penetrating cryoprotectant is a plant based lecithin from soybean to avoid the interaction of the sperm cells and enzyme from the egg yolk. In this case, more sperm cells is ensured alive once introduced into the reproductive tract of the doe. The diluted semen is pack in semen straws and incubated at 5°C for four (4) hours. After the incubation period, the semen is slowly plunged into the liquid nitrogen tank. In the assessment of the post-thaw motility of the spermatozoa shows that it increase from 30% to 50%.',NULL,'Goat Raisers','NCR',NULL,2012,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(24,'2021-08-02 01:47:56','2021-08-02 02:12:26','Goat Semen Extender (An Extender Formulation for Goat Semen)','The formulation produced is a refinement to the existing goat semen extender intended for artificial insemination. Goat sperm cell is characterized as unique to the other livestock sperm cells, in terms of its reaction to the eggyolk. Semen diluents used in processing commonly contain eggyolk as a protection against cold and freezing related damages in the sperm cells. This invention comprises buffer solution, non-penetrating cryoprotectant and penetrating cryoprotectant. The said non-penetrating cryoprotectant is a plant-based lecithin from soybean. Inclusion of the said lecithin improves the post-thaw motility of the spermatozoa, and enhances pH stability thereby increases storage period under refrigerated condition up to 110 hours. The formulation is in powdered form and packed in PET/PE foil material to protect its chemical content from environmental damages.',NULL,'Goat Raisers','Region 2',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(25,'2021-08-02 02:04:48','2021-08-02 03:00:13','BioGroe (Microbial Inoculants from Plant Growth Promoting Rhizobacteria)','BioGroeTM is a solid-based microbial inoculant containng plant-growth-promoting-bacteria (PGPB), which are root-associated bacteria inducing root growth by producing plant hormones and providing nutrients in soluble form.  Based on the research conducted by UPLB- BIOTECH, the use of BioGroeTM with the recommended rate of chemical fertilizer provided a significant increase in growth rate and productivity of high value crops such as corn and rice.',NULL,NULL,'Region 4A',NULL,2006,0,0,9,0,NULL,NULL,NULL,NULL,5127033.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(26,'2021-08-02 02:23:45','2021-08-02 02:57:22','Ethnobotanical Anthelmintic for Free Range Native Chicken (Ethnobotanical Dewormer Composition for Native Chicken)','This model presents a composition for an ethnobotanical dewormer for native chicken using the powder forms of mature seeds of betel nut (Areca catechu) and ipil-ipil (Leucaena lecocephala) as main ingredients. These plants contain constituents that serve as cheap sources of anthelmintics against internal parasitism. Internal parasitism in native chicken can cause severe diarrhea and high mortality. The formulation can be used for the treatment and control of roundworms, including common large roundworms of native chicken (Ascaridia galli), common thread worms (Capillaria specie), and the cecal worm (Heterakis gallinarum) and gape worm (Syngamus trachea).',NULL,NULL,'Region 6',NULL,2012,0,0,9,0,NULL,NULL,NULL,NULL,2024881.28,'2016-03-01','2017-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(27,'2021-08-02 02:28:37','2021-08-02 02:55:10','Betelnut Dewormer Composition for Chicken (Betel Nut (Areca catechu) Deworming Composition for Chickens)','The present utility model relates to a deworming composition comprising betel nut (Areca catechu) seed, antibacterial agent, antifungal agent and dextrose powder. Preferably, the betel nut seed is mature and processed into powder form.',NULL,NULL,'Region 6',NULL,2015,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(28,'2021-08-02 03:11:43','2021-08-02 03:16:25','Swine PED Virus Test Kit (ANDALI RT-LAMP Test Kit)','The PEDV Reverse transcription Loop-Mediated Isothermal Amplification (RT-Lamp) test kit is a quick reliable cost-effective diagnostic tool for the early detection and control of Porcine Epidemic Diarrhea Virus (PEDV) in swine.  The fast, early and timely diagnosis of PED infection will greatly reduce production losses by minimizing mortalities associated with the disease.  It would also enhance the capability of private and regional animal disease diagnostic laboratories in the diagnosis of the PED virus infection.',NULL,NULL,'Region 3',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(29,'2021-08-02 03:19:02','2021-08-02 03:20:26','Swine PED Virus Test Kit (ANDALI RT-LAMP Test Kit) -Sa Andali mabilis ang resulta, Mati-PED pa!','Trademark for ANDALI RT-LAMP Test Kit',NULL,NULL,'Region 3',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(30,'2021-08-02 03:28:08','2021-08-02 03:28:08','Rice Transplanter Attachment (Hand Tractor with Transplanter Attachment Apparatus)','The rice transplanter implement can be readily mounted to and dismounted from the common hand tractor.  It was aimed that the availability of such implements will significantly increase further the utilization of hand tractor in farm areas as well as to reduce the cost of farm level mechanization that will directly benefit the farmers, rice field owners and planters.',NULL,NULL,'NCR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(31,'2021-08-02 03:40:45','2021-08-02 03:45:31','NutrioTM Biofertilizer for Eggplant and Sugarcane','NUTRIOTM is a biofertilizer that uses endophytic bacterial inoculants which promote nitrogen fixation and production of plant growth promoting hormones of eggplant and sugarcane. It is a foliar spray biofertilizer in powdered form suspended in water and is directly sprayed on growing crops. It is also a stand-alone product.',NULL,NULL,'Region 4A',NULL,2015,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Toxicological Study and Pilot Testing of Nutrio™ Biofertilizer for Improved Production of Sugarcane in Regions III and VI','DOST-PCAARRD','University of the Philippines Los Baños',5000000.00,'2017-11-16','2020-05-15',NULL,NULL,NULL),(32,'2021-08-02 03:47:40','2021-08-02 03:50:39','Mykoplus Biofertilizer','MykoPlus biofertilizer is a breakthrough agricultural solution in improving crop production by significantly reducing the amount of required synthetic fertilizer application in farm operations while improving soil condition. It capitalizes on naturally-occurring microbial organisms such as mycorrhiza and phosphorus solubilizing bacteria to enhance nutrient uptake of plants. It is intended to help farmers in their farming operations by lowering the total cost of soil fertilization as well as allowing a more sustainable agricultural practice through the preservation of the soil’s natural ecosystem. Mykoplus promises to serve as a source of affordable and sustainable biofertilizer that can improve the yield of farmers and fortify the survivability of crops to withstand various pernicious environmental factors. It is a stand-alone product in the form of powder which is applied as seeds as coating.',NULL,NULL,'Region 4A',NULL,2015,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Field testing','MykoPlus Technology Promotion and Demonstration Trials for Yellow Corn and Eggplant','DOST-GIA','University of the Philippines Los Baños',2428000.00,'2012-06-01','2015-05-31',NULL,NULL,NULL),(33,'2021-08-02 03:59:58','2021-08-02 04:04:23','ACTIConTM Biopesticide for Cavendish Banana','ACTICon™  a biopesticide that uses the fungi actinomycetes as a biocontrol agent against the devastating Fusarium wilt-causing F. oxysporum TR4  (Foc TR4) or more commonly known as the Panama wilt in Cavendish bananas. It was developed to serve as a replacement for the synthetic chemical pesticides that is currently being excessively used in the market, causing harm to the environment, as well as to the human and animal health.',NULL,NULL,'Region 4A',NULL,2017,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Pilot Testing of Actinomycetes Biocontrol Agents (ACTICon Against Fusarium oxysporum TR4 in Cavendish Banana','DOST-PCAARRD','University of the Philippines Los Baños',5000000.00,'2018-03-01','2021-02-28',NULL,NULL,NULL),(34,'2021-08-02 04:15:46','2021-08-02 04:25:54','Generally Regarded as Safe  (GRAS) Coatings (A Process of Producing A Natural Coating Composition from Ethanolic Starfruit Leaf Extract)','The present utility model is a natural coating composition from ethanolic starfruit (Averrhoa carambola L) leaf extract comprising of 50 grams Averrhoa carambola L. leaves, 500 ml ethanol and 4,500 ml distilled water. It was tested that the natural coating extended the shelf life of fresh vegetables particularly tomatoes and string beans. The process of producing the natural coating consist of cutting or slicing the leaves of the starfruit into small pieces and percolated separately with distilled water, ethanol, and acetic acid as extractants. Every gram of the plant material was added with 10 milliliters of the ethanol and the mixtures were percolated overnight or for 24 hours. The mixtures were then filtered. The corresponding filtrates were diluted to 1% concentration as coating solutions.',NULL,NULL,'Region 8',NULL,2016,0,0,9,0,NULL,'Generally Regarded as Safe (GRAS) Coatings to Enhance Shelf-life of Vegetables','DOST-PCAARRD','Visayas State University',983000.00,'2012-04-01','2014-03-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(35,'2021-08-02 04:37:11','2021-08-02 04:47:02','Generally Regarded as Safe  (GRAS) Coatings (Natural Coating Composituin from Ethanolic Starfruit Leaf Extract)',NULL,NULL,NULL,'Region 8',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(36,'2021-08-02 04:48:44','2021-08-02 04:50:41','Generally Regarded as Safe  (GRAS) Coatings (Process of Producing a Natural Coating from Acetic Acid Averrhoa carambola L.)','The present utility model is a natural coating composition from acetic acid Averrhoa carambola L. leaf extract comprising of 50 grams Averrhoa carambola L. leaves, 500 ml of acetic acid and 4,500 distilled water. It was tested that the natural coating extended the shelf-life of fresh vegetables particularly tomatoes and string beans. The process of producing the natural coating consist of cutting or slicing the leaves of the starfruit into small pieces and percolated separately with distilled water, ethanol, and acetic acid as extractants. Every gram of the plant material was added with 10 milliliter of the acetic acid and the mixtures were percolated overnight or for 24 hours. The mixtures were then filtered. The corresponding filtrates were diluted to 1% concentration as coating solutions.',NULL,NULL,'Region 8',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(37,'2021-08-02 04:53:23','2021-08-02 04:53:33','Generally Regarded as Safe  (GRAS) Coatings (Natural Coating from Aquaeous Averrhoa carambola L.)','The present utility model is a composition of natural coating from aqueous starfruit (Averrhoa carambola L) leaf extract comprising of 50 grams Averrhoa carambola L. leaves and 5 liters distilled water. It was tested that the natural coating extended the shelf life of fresh vegetables particularly tomatoes and string beans. The process of producing the natural coating consist of cutting or slicing the leaves of the starfruit into small pieces and percolated separately with distilled water, ethanol, and acetic acid as extractants. Every gram of the plant material was added with 10 milliliter of the solvent and the mixtures were percolated overnight or for 24 hours. The mixtures were then filtered. The corresponding filtrates were diluted to 1% concentration as coating solutions.',NULL,NULL,'Region 8',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(38,'2021-08-02 04:55:43','2021-08-02 04:55:51','Generally Regarded as Safe  (GRAS) Coatings (Natural Coating Composition from Acetic Acid Averrhoa carambola L.)','Improve the post harvest shelf-life of vegetables in Eastern Visayas through the utilization of “GRAS” coatings for harvested vegetables',NULL,NULL,'Region 8',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(39,'2021-08-02 04:59:49','2021-08-02 04:59:49','Trichoderma Microbial Inoculant (TMI)','TMI is used to control crop plant diseases caused by soil-borne fungal pathogens. It also serves as a biofertilizer, which digests and decomposes soil organic matter and releases mineral nutrients needed for the promotion of crop growth.',NULL,NULL,'Region 4A',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(40,'2021-08-02 05:07:16','2021-08-02 05:09:14','Carrageenan Plant Growth Promoter','Carrageenan is an indigestible polysaccharide (carbohydrates) extracted from edible seaweeds.  Polysaccharide, when subjected to modified irradiation technology, can be an effective plant growth supplement. At a very small dose, this supplement makes an effective organic fertilizer.  It has been found to increase rice yield by 15-30%. The application of three and six bags of chemical fertilizer per ha, combined with 20 ml/L of carrageenan yields higher grain weight (450g and 455 g/10 hills, respectively) than the farmers\' practice of applying nine bags of chemical fertilizer/ha.  Carrageenan enhances the crop vigor of rice. Productive tillers and panicle length (length of inflorescence) are significantly higher in Carrageenan-treated plants. Productive tillers are the rice stems that bear panicles (rice inflorescence) with fertilized grains, while longer rice panicle is associated with producing more grains.',NULL,NULL,'Region 11',NULL,2015,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(41,'2021-08-02 05:11:12','2021-08-02 05:12:17','Carrageenan Plant Growth Promoter','Carrageenan is an indigestible polysaccharide (carbohydrates) extracted from edible seaweeds.  Polysaccharide, when subjected to modified irradiation technology, can be an effective plant growth supplement. At a very small dose, this supplement makes an effective organic fertilizer.  It has been found to increase rice yield by 15-30%. The application of three and six bags of chemical fertilizer per ha, combined with 20 ml/L of carrageenan yields higher grain weight (450g and 455 g/10 hills, respectively) than the farmers\' practice of applying nine bags of chemical fertilizer/ha.  Carrageenan enhances the crop vigor of rice. Productive tillers and panicle length (length of inflorescence) are significantly higher in Carrageenan-treated plants. Productive tillers are the rice stems that bear panicles (rice inflorescence) with fertilized grains, while longer rice panicle is associated with producing more grains.',NULL,NULL,'Region 6',NULL,2015,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(42,'2021-08-02 05:15:34','2021-08-02 05:15:34','SFEED Forage-based Pellet Feeds for Goat','Pellet feeds are bite-size pieces of sundried compressed nutritionally-balanced mixture of forage and grain ingredients such as ipil-ipil, rice bran, copra and molasses.',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(43,'2021-08-02 05:20:24','2021-08-02 05:23:12','Pelletizing Machine for Goat Feeds (Forage-Based Pellets for Dairy Goat)','A portable pellet mill developed mainly from scrap-materials that is appropriate for on-farm pellet production.  It is used in pelletizing total mixed ration (TMR) for goats.  It has a milling capacity of 130 kg/hr and machine efficiency of 93.30% with fuel consumption of 0.17 li/hr.',NULL,NULL,'Region 3',NULL,2009,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Field testing','Testing and Evaluation of Machinery Generated from PCAARRD-funded Projects','DOST-PCAARRD','University of the Philippines Los Baños',3305897.00,'2017-06-16','2019-05-15',NULL,NULL,NULL),(44,'2021-08-02 05:37:28','2021-08-02 05:37:28','FertigroeTM Controlled-Release Fertilizer','Controlled-release nitrogen fertilizer (CRNF) aims to replace conventional fertilizer and to reduce the cost of farming. The technology utilized the inherent properties of nanofertilizer, such as controlled release of nitrogen and greater surface area for higher absorption rate. Since CRNF can fully replace conventional fertilizers, the input cost of farming can be minimized. Reduced amount in comparison with conventional fertilizers (up to 50% reduction) will be needed to acquire targeted plant development when CRNF is used.',NULL,NULL,'Region 4A',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(45,'2021-08-02 05:39:21','2021-08-02 05:42:49','Mechanical Peanut Stripper and Sorter','The peanut stripper with pod sorter machine is used to separate the peanut pods from the vines, removing the dust, stacks and foreign materials, and sort the pods into three sizes. It has a capacity of 117 kg/h depending on the pod/vine ratio and or the variety and season of harvesting.',NULL,NULL,'Region 2',NULL,2017,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(46,'2021-08-02 05:45:49','2021-08-02 05:46:37','Mechanical Peanut Sheller-Sorter','A peanut sheller with sorter machine to separate the peanut kernel from pods and sort the kernels into three sizes. It has a capacity of 150 kg/h with an overall shelling performance that is above the standard set by the PAES (Philippine Agricultural Engineering Standards).',NULL,NULL,'Region 2',NULL,2017,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(47,'2021-08-02 05:47:52','2021-08-02 05:47:52','Chevon Valley Canned Products (Kalderetang Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(48,'2021-08-02 05:50:16','2021-08-02 05:50:16','Chevon Valley Canned Products (Adobong Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(49,'2021-08-02 05:51:59','2021-08-02 05:51:59','Chevon Valley Canned Products (Kilawing Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 2',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(50,'2021-08-02 05:54:36','2021-08-02 05:54:36','Chevon Products in Retort Pouch (Sinampalukan)','Chevon food products, namely, pinapaitan, sinampalukan, chevon bulgogi and sisig, are packed in retortable stand up pouches, processed through water retort.',NULL,NULL,'Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(51,'2021-08-02 05:57:35','2021-08-02 05:57:35','Chevon Products in Retort Pouch (Pinapaitan)','Chevon food products, namely, pinapaitan, sinampalukan, chevon bulgogi and sisig, are packed in retortable stand up pouches, processed through water retort.',NULL,NULL,'Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(52,'2021-08-02 06:00:28','2021-08-02 06:11:30','HiYeast Biocontrol Agent for Fruits and Vegetables','HiYEAST is a yeast-based biocontrol agent  that prevents fruit and vegetable decay caused by pathogens during postharvest handling. The technology is designed as an alternative and/or supplement to reduce the use of chemicals in nature. Consequently, it will reduce human health and environmental risks that comes with the use of existing synthetic control agents. It is applicable to fruits and vegetables, specifically, to banana, tomato, calamansi, mango, garlic, nuts and onion.',NULL,NULL,'NCR',NULL,NULL,0,0,9,0,NULL,'Project 6. Yeast Application for Biocontrol of Postharvest Pathogens of Fruits and Vegetables','DOST','University of the Philippines Los Baños',941800.00,'2012-06-01','2015-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(53,'2021-08-02 06:29:45','2021-08-02 06:35:26','\"Ride-on Precision Seeder for Wet Direct Seeding (Old name: Riding-type, self propelled rice seeder)\"','The machine is a local 8-row riding-type precision seeder that can have a seeding rate of 15kg/ha to 30 kg/ha and at least 2 ha/day field capacity and suitable both for hybrid and inbred rice production.',NULL,NULL,'Region 4A',NULL,NULL,0,0,9,0,NULL,'Project 1. Development of a locally adapted and manufactured riding type precision seeder','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice)',2844013.00,'2013-07-01','2014-06-30','Pilot testing','Pilot Testing of a Locally Manufactured Riding-type Precision Seeder','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice)',0.00,NULL,NULL,NULL,NULL,NULL),(54,'2021-08-02 06:37:52','2021-08-02 06:40:36','JAmp© Juan Amplification WSSV Detection Kit (Old name: LAMP Kit for Shrimp Pathogens)','Loop-Mediated Isothermal Amplification (LAMP) diagnostic kit is a practical alternative to the conventional polymerase chain reaction (PCR) and standard microbiological techniques in the detection of White Spot Syndrome Virus (WSSV). It is 10x more sensitive for the detection of WSSV compared to PCR. It is aided by a heat block apparatus which replaces the expensive thermal cycler. Results can also be obtained within 1 hour. Due to its convenience, simplicity and speed of detection, it can be used on-site. Diagnostic kit utilizing locally fabricated machine will significantly bring down the cost of pathogen detection in the country.',NULL,NULL,'NCR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Project 6. Technology Transfer and Adoption of LAMP Assay to Shrimp Farmers','DOST-PCAARRD','University of Sto. Tomas',5842779.00,'2014-10-01','2016-12-31',NULL,NULL,NULL),(55,'2021-08-02 06:43:16','2021-08-04 01:44:04','Biosensor Kit for Shrimp Pathogens (Target Optimization in Nucleic Acid Based lateral Flow Strip Biosensor (LFSB) Detection)','One of the keys to reducing the risk of diseases in shrimp is prevention and early detection. Affordable, rapid, and easy to use for diagnosis of pathogen for shrimps method that involves the use of genome-based lateral flow strip biosensor has been developed as a diagnostic platform for white spot syndrome virus (WSSV) and other shrimp pathogens. The test strips are field-ready, with an extraction and mobile device kit for first level screening of pathogens on site. Test strips may also be coupled with polymerase chain reaction (PCR) amplification of DNA extracts for faster and low level detection. The test strips may be multiplexed for simultaneous detection of more than one pathogen.  The use of mobile strip reader and an accompanying application (app) instantaneously allows the test results of the diagnostic strips to be fed into an on-line pathogen information resource and biosurveillance system.  The mobile strip reader will link the data captured by the app to the cloud server, which in turn is linked to a biosurveillance data center at the Southeast Asian Fisheries Development Center (SEAFDEC).',NULL,'Aquaculture','NCR',NULL,NULL,0,0,9,0,NULL,'Project 3. Development of shrimp pathogen diagnostic tools using nested PCR and lateral flow strip biosensors with mobile app and cloud-based information management','DOST-PCAARRD','Ateneo de Manila University',15436281.49,'2013-11-16','2015-12-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(56,'2021-08-02 06:52:15','2021-08-04 01:37:12','Biosensor Kit for Shrimp Pathogens (Lateral Flow Strip Biosensor (LFSB) Signal Amplification in Nucleic Acid Based Detection)','One of the keys to reducing the risk of diseases in shrimp is prevention and early detection. Affordable, rapid, and easy to use for diagnosis of pathogen for shrimps method that involves the use of genome-based lateral flow strip biosensor has been developed as a diagnostic platform for white spot syndrome virus (WSSV) and other shrimp pathogens. The test strips are field-ready, with an extraction and mobile device kit for first level screening of pathogens on site. Test strips may also be coupled with polymerase chain reaction (PCR) amplification of DNA extracts for faster and low level detection. The test strips may be multiplexed for simultaneous detection of more than one pathogen.  The use of mobile strip reader and an accompanying application (app) instantaneously allows the test results of the diagnostic strips to be fed into an on-line pathogen information resource and biosurveillance system.  The mobile strip reader will link the data captured by the app to the cloud server, which in turn is linked to a biosurveillance data center at the Southeast Asian Fisheries Development Center (SEAFDEC).',NULL,'Aquaculture','NCR',NULL,NULL,0,0,9,0,NULL,'Project 3. Development of shrimp pathogen diagnostic tools using nested PCR and lateral flow strip biosensors with mobile app and cloud-based information management','DOST-PCAARRD','Ateneo de Manila University',15436281.49,'2013-11-16','2015-12-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(57,'2021-08-02 06:58:57','2021-08-02 07:04:33','Local Riding-type Rice Transplanter','Suitable for transplanting inbred and hybrid rice. It can transplant 2 to 6 seedlings per hill at a planting depth of 2-6 cm, hill spacing of 12-18 cm, and row spacing of 30 cm. Helps minimize labor cost compared to manual transplanting, which requires 20-25 persons/day/ha and takes only two persons to complete transplanting activities and has a planting capacity of 2 ha/day with 24 hills/m2 planting density.',NULL,NULL,'Region 3',NULL,2018,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Pilot Testing of Local Riding Type Transplanter','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice) - Muñoz',4527613.00,'2016-11-01','2018-10-31',NULL,NULL,NULL),(58,'2021-08-02 07:10:35','2021-08-02 07:17:56','MicroMix Biostimulant for Bell Pepper and Bitter Gourd','MicroMix contains biostimulant-producing microbes selectively obtained from different rhizospheres and optimally combined to perform at its best using DNA-based techniques. MicroMixBG is used for bitter gourd while MicroMixBP is used for bell pepper. When applied by seed coating, it enhances root system for better growth and increase yield by more than 15%.',NULL,NULL,'NCR',NULL,2016,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Pilot Testing and Pre-commercialization Analysis of Micromix as Microbial Based Stimulants for Improved Productivity of Solanaceous (Bell Pepper) and Cucurbits (Bittergourd)','DOST-GIA','University of the Philippines Los Baños',4975606.80,'2020-01-15','2021-01-14',NULL,NULL,NULL),(59,'2021-08-02 07:20:40','2021-08-02 07:23:47','BioGreen Plus (Kakawate (Gliricidia sepium)-based Microbial Inoculant)','BioGreen is a processed compost enriched with beneficial microbial inoculants. In producing Bio-Green, inoculants of cellulolytic fungi and nitrogen-fixing bacteria are added before and after composting. After maturation, the inoculated compost is humified, stabilized and sanitized. The quality bio-organic fertilizer is proven to improve crop growth and yield. Depending on the soil type, BioGreen applied at 10-20 bags/ha can equal the effects of chemical fertilizers applied at a rate of 60-30-30. In combination with half dosage of chemical fertilizer, BioGreen can give superior yields.',NULL,NULL,'Region 4A',NULL,2017,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(60,'2021-08-02 07:25:16','2021-08-02 07:28:02','WiltCure™ Biopesticide','WiltCure, a biopesticide, can effectively control Fusarium wilt in tomato, eggplant, and hot pepper, resulting in more vigorous growth and higher yield.',NULL,NULL,'Region 4A',NULL,2015,0,0,9,0,NULL,'Callus and Microbe Co-culture as a Novel Source of Biopesticides against Major Agricultural Pests and Diseases','DOST-GIA','University of the Philippines Los Baños',1291900.00,'2012-07-01','2015-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(61,'2021-08-02 07:31:16','2021-08-02 07:34:36','Nursery and pond management for shrimp (Ulang) production','The intervention applied by the new technology on the culture of ulang in ponds follows the rearing in the nursery of post larva before stocking, sorting for growing in the hatchery and sorting during harvest.',NULL,'Shrimp Growers','Region 4A',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(62,'2021-08-02 07:37:07','2021-08-02 07:45:14','Sorting method during harvesting of ulang','The sorting method is done when the pl is about 3 months old and be stocked separately in different pond compartments by size to allow the small ones to utilize the inputs for them to grow faster to marketable size and variation in size will be prevented.',NULL,'Shrimp Growers','Region 4A',NULL,NULL,0,0,9,0,NULL,'S&T Community Based Farm (STCBF) on Improving Ulang Production in Quezon Province','DOST-PCAARRD','Ms. Emiliana Casbadillo/BFAR R4A',1870178.00,'2013-01-18','2015-04-17',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(63,'2021-08-02 07:49:04','2021-08-02 07:56:45','Tissue-cultured Lakatan banana planting materials','Built-in resistance in lakatan is identifed as a good management strategy to effectively control the spread of Banana Bunchy Top Virus (BBTV) which has no known cure. BBTV-resistant lakatan mutant lines were developed through irradiation and is currently showing intermediate resistance to the disease. Disease spread was observed to be slower in lakatan mutant lines compared to ordinary lakatan.',NULL,NULL,'Region 4A',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,1109700.00,'2011-11-28','2013-11-27',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(64,'2021-08-03 03:52:10','2021-08-03 03:52:10','Rehabilitation of less productive coconut trees',NULL,NULL,NULL,'Region 11',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(65,'2021-08-03 04:20:59','2021-08-03 04:20:59','Chemical-free carrot using vermicompost','Vermicompost is the product or process of composting using various worms, usually red wigglers, white worms, and other earthworms to create a heterogeneous mixture of decomposing vegetable or food waste, bedding materials, and vermicast. Vermicompost serves as a natural fertilizer to improve the overall stand of crops.',NULL,NULL,'Region 10',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(66,'2021-08-03 04:26:10','2021-08-03 04:26:10','Carrot production using natural farming technology system (NFTS)','The technology involves the use of insecticides/pesticides using available herbs/plants found in the environment/surroundings such as indigenous microorganisms (IMO), fermented plant juice (FPJ), fermented fruit juice (FFJ), fish amino acid (FAA), oriental herbal nutrients (OHN), calcium phosphate (CaPhos), natural insect attractant (NIA), composted bran with IMO and fermented herbal medicines (FHM).',NULL,NULL,'Region 10',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(67,'2021-08-03 04:27:03','2021-08-03 04:27:03','Carrot concentrate in bottles','Providing alternative uses for carrot, the bottled carrot concentrate is an innovative way of allowing households to consume the product in a different fashion besides traditional cooking.',NULL,NULL,'Region 10',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(68,'2021-08-03 04:29:10','2021-08-03 04:29:10','Jackfruit bagging technology','The technology involves the application of urea, complete and organic fertilizer from   first to third year. Same fertilizers should be applied with the addition of solophos. For the succeeding years, year 4,5,6 and above, complete, organic and muriate of potash should be applied.',NULL,NULL,'Region 8',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(69,'2021-08-03 04:29:57','2021-08-03 04:29:57','Jackfruit pruning and thinning','\"Pruning is the removal of small, unproductive as well as diseased and insect damaged branches. Since fruits are usually produced on the trunk and large branches, pruning would provide more light and air to the developing fruits.\r\n\r\nThinning is done to obtain good quality and well developed fruits. This process allows only one fruit to develop per foot stalk by removing those arising from the sides of the peduncle. A maximum of three fruits per tree should be maintained during the first year of fruiting but allow the trees to produce more fruits as it grows older. The optimum number of fruits on the 7th year is eight and this gradually increases to 20 fruits per tree on the 15th year.\"',NULL,NULL,'Region 8',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(70,'2021-08-03 04:31:11','2021-08-03 04:31:11','Jackfruit EVIARC variety','EVIARC  sweet variety is recommended for processing but can be used for fresh fruit because of its high sugar content or total soluble solids. This variety has been promoted by the Department of Agriculture (DA) - Region 8 for commercial scale production because it is well adapted to the region. It is also the preferred variety of  the processors due to its thick aril and high edible portion of 42.58%, which would give bigger profit margins compared to other jackfruit varieties. Also, its golden flesh has moderate latex.',NULL,NULL,'Region 8',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(71,'2021-08-03 04:31:55','2021-08-03 04:31:55','Use of high yielding varieties of camote (NSIC Sp 30)',NULL,NULL,NULL,'Region 8',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(72,'2021-08-03 04:34:04','2021-08-03 04:34:04','Rice productivity using carageenan plant food supplement from seaweeds','Carageenan is an indigestible polysaccharide (carbohydarates) extracted from edible seaweeds. When subjected to modified irradiation technology, polysaccharide can be an effective plant growth supplement. At a very small dose, this supplement makes an effective fertilizer supplement. Carageenan enhances the crop vigor of rice. Productive tillers and panicle length (length of inflorescence) are significantly higher in carageenan-treated plants. Productive tillers are the rice stems that bear panicles )(rice inflorescence) with fertilized grains, while longer rice panicle is associated with producing more rice grains.',NULL,NULL,'Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(73,'2021-08-03 04:37:55','2021-08-03 04:38:18','Use of drought-resistant rice or early maturing rice varieties',NULL,NULL,NULL,'Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(74,'2021-08-03 04:39:19','2021-08-03 04:39:19','Use of high-quality rice seeds [certified seeds CS)/Registered seeds (RS)/Good Seeds (GS)',NULL,NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(75,'2021-08-03 04:39:48','2021-08-03 04:39:48','Rice-based cropping (rice + mushroom; rice + duck; rice + fish; rice + livestock)',NULL,NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(76,'2021-08-03 04:40:16','2021-08-03 04:40:16','Rice seed production',NULL,NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(77,'2021-08-03 04:41:02','2021-08-03 04:41:39','Integrated Crop Management (ICM)','\"Integrated Crop Management (ICM) practices on rice production:\r\n 1) High quality seeds of the recommended variety\r\n 2) Sufficient nutrients at tillering to early panicle initiation and flowering\r\n 3) Application of 3-5 cm water depth every irrigation time from early tillering until 1-2 weeks before crop maturity\r\n 4) Pest management\"',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(78,'2021-08-03 04:42:26','2021-08-03 04:42:26','Rice harvest management','The procedure involves the following: a) threshing of palay right or a day after harvest using a clean thresher with the correct machine setting; b) harvest when 85-90% of the grains at the base of the panicle are in hard dough and most of the grains in the panicle are golden yellow; c) avoid piling the harvest crop in the field for more than a day as this results in heat buildup in the grain; and d) drying and storage.',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(79,'2021-08-03 23:40:11','2021-08-03 23:40:11','Rice production - pest management','The procedure involves the following: a) use of resistant varieties to pests and diseases prevalent in the locality; b) good land preparation; c) follow synchronous planting scheme after a follow period; d) conservation and use of biological control; e) varietal rotatio;n f) sound fertilizer and water management; and  g) monitoring of crops regularly.',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(80,'2021-08-03 23:47:58','2021-08-03 23:47:58','Use of Mokusako',NULL,NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(81,'2021-08-03 23:48:25','2021-08-03 23:48:25','Use of Trichoderma as biocontrol agent, yellow sticky trap, and Mokusako',NULL,NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(82,'2021-08-03 23:49:04','2021-08-03 23:49:04','Use of BSU-PCAARRD organic fertilizers',NULL,NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(83,'2021-08-03 23:49:26','2021-08-03 23:49:26','Use of tissue-cultured planting materials',NULL,NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(84,'2021-08-03 23:52:58','2021-08-03 23:52:58','Mango Hot Water Treatment','A postharvest equipment and process where mangoes are gradually dipped in hot water for a certain period to reduce postharvest losses (handling and disease infestation-anthracnose/stem-end rot) and increase fruit quality for export.',NULL,NULL,'Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(85,'2021-08-03 23:54:03','2021-08-03 23:54:03','Package of technologies (POT) for mango production','The package of technologies (POT) for mango production is a holistic approach that ensures profitable yet environmentally sound mango production. The POT makes use of integrated crop management (ICM) technologies such as pruning, nutrition management, water management, paclobutrazol application, flower induction, pest and disease management. It also involves post-harvest quality management (PQM) technologies on harvesting, fruit handling, trimming and delatexing, sorting and grading, postharvest disease management, and packaging.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(86,'2021-08-03 23:57:59','2021-08-03 23:57:59','Coffee rejuvenation','This process involves cutting of vertical stems of old coffee trees to induce growth of new sprouts.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(87,'2021-08-04 00:00:39','2021-08-04 00:00:39','Coffee production biopesticides','Biological agents for the management of major insect pests and diseases of arabica coffee for organic production.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(88,'2021-08-04 00:02:09','2021-08-04 00:02:09','Coffee harvesting','Harvesting of coffee  begins when berries start to fully ripen. Those shiny coffee red berries are to be handpicked during  harvesting and the immature ones are left for continues growth.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(89,'2021-08-04 00:04:13','2021-08-04 00:04:13','Coffee production using organic fertilizers','The technology is a formulated solid and liquid organic fertilizers which are made from readily available  materials found in organic arabica coffee production areas in Benguet. These are applied to arabica coffee trees to provide continuous supply of nutrients at the critical stages of the arabica coffee to improve yield and bean quality.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(90,'2021-08-04 00:04:45','2021-08-04 00:04:45','Coffee wet processing','The wet processing method of coffee is performed to obtain good quality coffee. Berries are depulped within 24 hours after picking since any delay can cause heating through fermentation and will spoil the flavor. The procedure or steps involved in wet processing include flotation, pulping, fermentation, washing, drying, dehulling and sorting.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(91,'2021-08-04 00:05:09','2021-08-04 00:05:09','Coffee pruning','Pruning in coffee is done once a year before flowering and after the last harvest. Infested, diseased, and dead  twigs and branches were removed using a pruning shear to prevent the spread of diseases and infestation of insect pests. Pruning also enhanced productivity, facilitate harvesting and other cultural operations.',NULL,NULL,'CAR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(92,'2021-08-04 00:09:26','2021-08-04 00:09:26','Biological interventions through mass-rearing and release of BCAs - both parasitoids and predators','The technology involves the use of naturally-occurring insect predators and parasitoids as one of the integrated pest management strategies for CSI infestation. Insect predators such as Telsimia sp. and Chilochorus sp. Parasitize CSI by 65-92%.  The use of biological control using native parasitoids or predators could be a safer and more sustainable alternative to chemical control of CSI infestation.',NULL,NULL,'Region 12',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(93,'2021-08-04 00:14:56','2021-08-04 00:14:56','Use of predatory black earwig Chelisoches morio (Fabr.) (Chelisochidae, Dermaptera) as biocontrol control agents of invasive pests of coconut',NULL,NULL,NULL,'Region 4A',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(94,'2021-08-04 00:21:07','2021-08-04 00:21:07','Salt technology to improve cocosap production',NULL,NULL,NULL,'Region 11',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(95,'2021-08-04 00:21:38','2021-08-04 00:21:38','Rehabilitation of less productive coconut trees',NULL,NULL,NULL,'Region 11',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(96,'2021-08-04 01:23:40','2021-08-04 01:35:43','Juan Algae Microalgal Paste (Method and Composition of Microalgae Paste)','Algae pastes are concentrates of liquid microalgae cells which are used in nurseries as feed for larval fish, shrimp and other aquaculture species. The microalgae paste is an instant feed that can be used as an alternative to on-site algal culture especially when rations of live algae are insufficient. It is easy to apply and can be provided to the stock anytime.',NULL,'Aquaculture','NCR',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Project 1. Pilot-testing of microalgae paste as feed for shrimp and milkfish hatcheries','PCAARD-GIA','University of the Philippines Visayas-College of Fisheries and Ocean Sciences (UPV-CFOS)',4170088.00,'2017-07-01','2018-06-30',NULL,NULL,NULL),(97,'2021-08-04 01:39:47','2021-08-04 01:41:48','Sea Cucumber Dryer','A hybrid sea cucumber dryer comprising: a rectangular body having an upper member and a lower member. The said upper member of the hybrid sea cucumber dryer where drying is accomplished is mounted on top of the said lower member. The said upper member of the hybrid sea cucumber dryer comprising: a clear glass panel mounted on top of said upper member, a number of drying trays that easily slide into the tray holders, two vertical partitions that divide the said upper member into three, a number of doors for each division and air shutters which are all secured to the said rectangular body. The said lower member of the hybrid sea cucumber dryer where the drying air is heated in the absence of solar radiation is provided with a heating plate secured at the top portion of said lower member, an opening being secured on one side of the lower member, an air vent and a peep hole being secured at the opening, and a chimney protruding upwardly from the back side of said lower member. Said hybrid sea cucumber dryer uses a rice hull stove as heat source but other combustible biomass materials like wood, charcoal, corn cobs, etc. can be used as alternative fuel source.',NULL,'Coastal area','Region 4A',NULL,2014,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(98,'2021-08-04 01:53:17','2021-08-04 01:53:17','Coral nursery units (CNUs) for coral rehabilitation',NULL,NULL,'Coastal Area','Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(99,'2021-08-04 01:56:40','2021-08-04 01:56:40','Mangrove crab soft shell production','Scylla spp. Juveniles (crablets) are obtained from hatcheries and reared in net cages until 3-4 cm size and grown further in ponds for 1.5-2.0 months until they attain 60-100g body weight. At this size, crabs are placed individually in perforated plastic boxes on pvc floating platforms set in brackish water ponds. The crabs are fed with mollusk or low value fish every two days. Molting is monitored every four hours. Newly molded crabs are kept in aerated freshwater to prevent hardening of shell. After one hour, the soft-shelled crabs are sorted and packed in plastic food containers for freezing.',NULL,NULL,'Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(100,'2021-08-04 02:00:08','2021-08-04 02:00:08','Milkfish broodstock management and fry production in tanks','Potential milkfish breeders are grown in earthen ponds and marine net cages, attaining 0.5-3 kg each. Breeders are later reared in concrete tanks until they reach sexual maturity at 5-6 years of age. To rear breeders in tanks, stocking should be done before the start of the breeding season to condition them for spawning in captivity and improve their assimilation  of feeds. A stocking density of 1 kg per cubic meter or 1-2 fish per square meter is recommended. Strong aeration should be provided to prevent oxygen depletion. A flow through system is set up to drain and replenish the water daily at a rate of 100-200% of the tank volume. The spawners are fed with formulated diet containing 37% protein and 8% lipid at 3-4% of the fish biomass per day.',NULL,'Milkfish growers','Region 6',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(101,'2021-08-04 02:04:16','2021-08-04 02:04:16','Seaweed (Gracilaria) production using net modules','The module  improves the production and yield of gracilaria which consists of the following: polyethylene net with #12 mesh size, polyethylene rope, oyster shells and twine. The polyethylene net  used has â ½ mesh size and cut into 20 centimeters by ten meters. The long axis is sewn together to enclose oyster shells. Series of these nets are then brought to the culture area and are anchored with stakes at both ends. Along the nets are several stakes to keep the net above the seabed. Suitable sites must have at least 20 centimeters of water left at low tide for this proposed methodology. When the nets are already fixed, insertion of mature fronds or portion of the plants follows.',NULL,'Coastal Area','Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(102,'2021-08-04 02:07:53','2021-08-04 02:07:53','Triangular method of seaweed farming','Modified triangular method of seaweed farming was derived from the innovative form of the traditional practice known as mono/multiple floating longline method, designed in deeper waters and is flexible enough to withstand strong winds and big waves.  The technology can also be applied in coastal communities with farm sites located in five (5) to ten (10) meters depth with a current speed of 20-40 meters per minute.  The aquaculture system is most efficient in terms of harvest volume and cost of production compared with other methods.  The technology can accommodate twenty (20) seedlings per triangle or 150,000 - 180,000 seedlings per hectare, a rate which is double compared to other methods.',NULL,'Coastal Area','Region 1',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(103,'2021-08-04 02:11:07','2021-08-04 02:11:07','Use of FAST (freshwater aquaculture center selected tilapia) lines in tilapia production','The FAST (a.k.a. IDRC) genetic material was developed from 1986 to 1996 as an International Development Research Center (IDRC) supported tilapia project at the Freshwater Aquaculture Center of the Central Luzon State University. This strain came from a base population of four-strain group namely Israel, Singapore, Taiwan and Philippine nile tilapia strain, a product of 12 generations of selection of best individuals within a family. To date, the FAST lines are now on its 31st generation of selection. The FAST was developed using a within family selection with rotational mating scheme. Its response to selection was estimated at 18% compared to the previous generation of selection (Bolivar and Newkirk, 2002).',NULL,'Tilapia Growers','Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(104,'2021-08-04 02:14:50','2021-08-04 02:14:50','\"FAST and EXCEL tilapia strains  Cage culture system\"','The technology involves a recommended package of technologies for tilapia grow-out operations in ponds, which includes the use of FAST and EXCEL tilapia strains, improved feed management practices, and culture system.',NULL,'Tilapia Growers','Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(105,'2021-08-04 02:17:00','2021-08-04 02:17:00','FAST and EXCEL tilapia strains in pond culture','The technology involves a recommended package of technologies for tilapia grow-out operations in ponds, which includes the use of FAST and EXCEL tilapia strains, improved feed management practices, and culture system.',NULL,'Tilapia Grower','Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(106,'2021-08-04 02:20:26','2021-08-04 02:20:26','Use of aquashade for tilapia production','The technology refers to the use of net (with the capacity to block 40% of sun rays) for shading was to reduce water temperature by more than 3°C during the hottest period of the day resulting to increased spawning rate and seed production by more than 100% in both seed production systems.',NULL,'Tilapia Grower','Region 3',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(107,'2021-08-04 02:30:41','2021-08-04 02:30:41','Banana \'Lakatan\' Package of Technology (POT)','The package of technology includes site selection considering soil type and climatic requirements, selection of quality planting materials, field planting, land preparation, fertilization, water management, pest and disease management, harvesting system, postharvest handling, and preparation for packing and transport. The package of technology also advocates the use of disease-free planting materials produced through tissue culture techniques.',NULL,NULL,'Region 4A',NULL,NULL,0,0,9,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(108,'2021-08-04 06:34:12','2021-08-04 06:36:36','Goat Semen Extender (An Improved Formulation used for Processing Goat Semen)','The semen extender formulation used in processing goat semen is composed of buffer solution, non-penetrating cryoprotectant and penetrating cryoprotectant. This formulation is used to ensure the viability of the sperm cells to be used in breeding using artificial insemination technique.',NULL,'Goat Raisers','Region 2',NULL,2016,0,0,9,0,NULL,'Project 3.2 Enhancement of cryopreservation protocols for improved goat semen quality','PCAARRD-GIA','Isabela State University (ISU)',747288.40,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(109,'2021-08-27 00:47:12','2021-10-19 06:55:35','Goat Semen Extender using Soy-Bean Lecithin-Based Extender','The formulation produced is a refinement to the existing goat semen extender intended for artificial insemination. Goat sperm cell is characterized as unique to the other livestock sperm cells, in terms of its reaction to the egg yolk. Semen diluents used in processing commonly contain egg yolk as a protection against cold and freezing related damages to the sperm cells. This utility model is comprise of buffer solution, non-penetrating cryoprotectant and penetrating cryoprotectant. The non-penetrating cryoprotectant is a plant based lecithin from soybean to avoid the interaction of the sperm cells and enzyme from the egg yolk. In this case, more sperm cells is ensured alive once introduced into the reproductive tract of the doe. The diluted semen is pack in semen straws and incubated at 5°C for four (4) hours. After the incubation period, the semen is slowly plunged into the liquid nitrogen tank. In the assessment of the post-thaw motility of the spermatozoa shows that it increase from 30% to 50%.',NULL,'Goat Raisers','NCR',NULL,2012,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(110,'2021-08-27 00:59:52','2021-10-19 06:55:47','Goat Semen Extender (An Improved Formulation used for Processing Goat Semen)','The semen extender formulation used in processing goat semen is composed of buffer solution, non-penetrating cryoprotectant and penetrating cryoprotectant. This formulation is used to ensure the viability of the sperm cells to be used in breeding using artificial insemination technique.',NULL,'Goat Raisers','NCR',NULL,2016,0,0,10,2,NULL,'Project 3.2 Enhancement of cryopreservation protocols for improved goat semen quality','PCAARRD-GIA','Isabela State University (ISU)',747288.40,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(111,'2021-08-27 02:25:01','2021-10-19 23:33:56','Goat Semen Extender (An Extender Formulation for Goat Semen)','The formulation produced is a refinement to the existing goat semen extender intended for artificial insemination. Goat sperm cell is characterized as unique to the other livestock sperm cells, in terms of its reaction to the eggyolk. Semen diluents used in processing commonly contain eggyolk as a protection against cold and freezing related damages in the sperm cells. This invention comprises buffer solution, non-penetrating cryoprotectant and penetrating cryoprotectant. The said non-penetrating cryoprotectant is a plant-based lecithin from soybean. Inclusion of the said lecithin improves the post-thaw motility of the spermatozoa, and enhances pH stability thereby increases storage period under refrigerated condition up to 110 hours. The formulation is in powdered form and packed in PET/PE foil material to protect its chemical content from environmental damages.',NULL,'Goat Raisers','NCR',NULL,2016,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(112,'2021-08-27 02:28:42','2021-10-19 23:34:05','BioGroe (Microbial Inoculants from Plant Growth Promoting Rhizobacteria)','BioGroeTM is a solid-based microbial inoculant containng plant-growth-promoting-bacteria (PGPB), which are root-associated bacteria inducing root growth by producing plant hormones and providing nutrients in soluble form.  Based on the research conducted by UPLB- BIOTECH, the use of BioGroeTM with the recommended rate of chemical fertilizer provided a significant increase in growth rate and productivity of high value crops such as corn and rice.',NULL,NULL,'Region 4A',NULL,2006,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'6128564b0bec0BioGroe.png'),(113,'2021-08-27 03:14:06','2021-10-19 23:34:07','Ethnobotanical Anthelmintic for Free Range Native Chicken (Ethnobotanical Dewormer Composition for Native Chicken)','This model presents a composition for an ethnobotanical dewormer for native chicken using the powder forms of mature seeds of betel nut (Areca catechu) and ipil-ipil (Leucaena lecocephala) as main ingredients. These plants contain constituents that serve as cheap sources of anthelmintics against internal parasitism. Internal parasitism in native chicken can cause severe diarrhea and high mortality. The formulation can be used for the treatment and control of roundworms, including common large roundworms of native chicken (Ascaridia galli), common thread worms (Capillaria specie), and the cecal worm (Heterakis gallinarum) and gape worm (Syngamus trachea).',NULL,NULL,'Region 6',NULL,2012,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'61285b177d94c2. Ethnobotanical Dewormer.jpg'),(114,'2021-08-27 03:22:27','2021-10-19 23:34:10','Betelnut Dewormer Composition for Chicken (Betel Nut (Areca catechu) Deworming Composition for Chickens)','The present utility model relates to a deworming composition comprising betel nut (Areca catechu) seed, antibacterial agent, antifungal agent and dextrose powder. Preferably, the betel nut seed is mature and processed into powder form.',NULL,NULL,'Region 6',NULL,2015,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(115,'2021-08-27 03:33:57','2021-10-19 23:34:13','Protein Enriched Copra Meal (PECM) as Feed for Swine and Poultry','The processing of agricultural crops leads to an inevitable increase in waste byproducts which poses major environmental issues. There is an evident need to utilize these in order to contribute to agro-industrial waste management. Copra meal is a by-product of the coconut industry. Although regarded as waste, it is known to comprise high nutritive value, however only small portions are used in the livestock due to its fibrous nature and high protein-carbohydrate complex which leads to lower animal digestibility. The present invention enhances the protein while decreasing the fiber content of copra meal through the action of Aspergillus strain in the substrate.',NULL,NULL,'Region 4A',NULL,2017,0,1,10,2,NULL,'Protein Enrichment of Copra Meal as Feed for Swine and Poultry','DOST-PCAARRD','University of the Philippines Los Baños',7477285.98,'2012-06-01','2015-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'61285f3416fb2PECM.jpg'),(116,'2021-08-27 03:44:48','2021-10-20 03:35:29','Swine PED Virus Test Kit (ANDALI RT-LAMP Test Kit)','The PEDV Reverse transcription Loop-Mediated Isothermal Amplification (RT-Lamp) test kit is a quick reliable cost-effective diagnostic tool for the early detection and control of Porcine Epidemic Diarrhea Virus (PEDV) in swine.  The fast, early and timely diagnosis of PED infection will greatly reduce production losses by minimizing mortalities associated with the disease.  It would also enhance the capability of private and regional animal disease diagnostic laboratories in the diagnosis of the PED virus infection.',NULL,NULL,'Region 3',NULL,2016,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'61286179168ccandali.jpg'),(117,'2021-08-27 03:55:29','2021-10-20 03:35:33','Rice Transplanter Attachment (Hand Tractor with Transplanter Attachment Apparatus)','The rice transplanter implement can be readily mounted to and dismounted from the common hand tractor.  It was aimed that the availability of such implements will significantly increase further the utilization of hand tractor in farm areas as well as to reduce the cost of farm level mechanization that will directly benefit the farmers, rice field owners and planters.',NULL,NULL,'NCR',NULL,2015,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(118,'2021-08-27 04:00:38','2021-10-20 03:35:37','Rice Harvester Attachment (System of Assembling a Combined Harvester and Thresher attachment to Hand Tractor and the Apparatus Therefrom)','An efficient rice harvesting implement that can be readily mounted to and dismounted  from the hand tractor unit thus, increasing the utilization of handtractor and helps reduce labor cost. It has an estimated capacity of 0.5 ha/day for an eight-hour operation.',NULL,NULL,'NCR',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(119,'2021-08-27 05:09:46','2021-10-20 03:35:44','Swine PED Virus Test Kit (ANDALI RT-LAMP Test Kit) -Sa Andali mabilis ang resulta, Mati-PED pa!','Trademark for ANDALI RT-LAMP Test Kit',NULL,NULL,'Region 3',NULL,2016,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(120,'2021-08-27 05:14:32','2021-10-20 03:35:53','NutrioTM Biofertilizer for Eggplant and Sugarcane','NUTRIOTM is a biofertilizer that uses endophytic bacterial inoculants which promote nitrogen fixation and production of plant growth promoting hormones of eggplant and sugarcane. It is a foliar spray biofertilizer in powdered form suspended in water and is directly sprayed on growing crops. It is also a stand-alone product.',NULL,NULL,'Region 4A',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Toxicological Study and Pilot Testing of Nutrio™ Biofertilizer for Improved Production of Sugarcane in Regions III and VI','DOST-PCAARRD','University of the Philippines Los Baños',5000000.00,'2017-11-16','2020-05-15',NULL,NULL,NULL),(121,'2021-08-27 05:20:06','2021-10-20 05:43:15','Mykoplus Biofertilizer','MykoPlus biofertilizer is a breakthrough agricultural solution in improving crop production by significantly reducing the amount of required synthetic fertilizer application in farm operations while improving soil condition. It capitalizes on naturally-occurring microbial organisms such as mycorrhiza and phosphorus solubilizing bacteria to enhance nutrient uptake of plants. It is intended to help farmers in their farming operations by lowering the total cost of soil fertilization as well as allowing a more sustainable agricultural practice through the preservation of the soil’s natural ecosystem. Mykoplus promises to serve as a source of affordable and sustainable biofertilizer that can improve the yield of farmers and fortify the survivability of crops to withstand various pernicious environmental factors. It is a stand-alone product in the form of powder which is applied as seeds as coating.',NULL,NULL,'Region 4A',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Field testing','MykoPlus Technology Promotion and Demonstration Trials for Yellow Corn and Eggplant','DOST-GIA','University of the Philippines Los Baños',2428000.00,'2012-06-01','2015-05-31',NULL,NULL,NULL),(122,'2021-08-27 05:28:37','2021-10-20 05:43:26','ACTIConTM Biopesticide for Cavendish Banana','ACTICon™  a biopesticide that uses the fungi actinomycetes as a biocontrol agent against the devastating Fusarium wilt-causing F. oxysporum TR4  (Foc TR4) or more commonly known as the Panama wilt in Cavendish bananas. It was developed to serve as a replacement for the synthetic chemical pesticides that is currently being excessively used in the market, causing harm to the environment, as well as to the human and animal health.',NULL,NULL,'Region 4A',NULL,2017,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Pilot Testing of Actinomycetes Biocontrol Agents (ACTICon Against Fusarium oxysporum TR4 in Cavendish Banana','DOST-PCAARRD','University of the Philippines Los Baños',5000000.00,'2018-03-01','2021-02-28',NULL,NULL,NULL),(123,'2021-08-27 05:37:47','2021-10-20 05:43:33','Generally Regarded as Safe  (GRAS) Coatings (A Process of Producing A Natural Coating Composition from Ethanolic Starfruit Leaf Extract)','The present utility model is a natural coating composition from ethanolic starfruit (Averrhoa carambola L) leaf extract comprising of 50 grams Averrhoa carambola L. leaves, 500 ml ethanol and 4,500 ml distilled water. It was tested that the natural coating extended the shelf life of fresh vegetables particularly tomatoes and string beans. The process of producing the natural coating consist of cutting or slicing the leaves of the starfruit into small pieces and percolated separately with distilled water, ethanol, and acetic acid as extractants. Every gram of the plant material was added with 10 milliliters of the ethanol and the mixtures were percolated overnight or for 24 hours. The mixtures were then filtered. The corresponding filtrates were diluted to 1% concentration as coating solutions.',NULL,NULL,'Region 8',NULL,2016,0,0,10,2,NULL,'Generally Regarded as Safe (GRAS) Coatings to Enhance Shelf-life of Vegetables','DOST-PCAARRD','Visayas State University',983000.00,'2012-04-01','2014-03-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(124,'2021-08-27 05:48:09','2021-10-20 05:43:38','Generally Regarded as Safe  (GRAS) Coatings (Natural Coating Composituin from Ethanolic Starfruit Leaf Extract)',NULL,NULL,NULL,'Region 8',NULL,2016,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(125,'2021-08-27 05:50:55','2021-11-03 04:34:43','Generally Regarded as Safe  (GRAS) Coatings (Process of Producing a Natural Coating from Acetic Acid Averrhoa carambola L.)','The present utility model is a natural coating composition from acetic acid Averrhoa carambola L. leaf extract comprising of 50 grams Averrhoa carambola L. leaves, 500 ml of acetic acid and 4,500 distilled water. It was tested that the natural coating extended the shelf-life of fresh vegetables particularly tomatoes and string beans. The process of producing the natural coating consist of cutting or slicing the leaves of the starfruit into small pieces and percolated separately with distilled water, ethanol, and acetic acid as extractants. Every gram of the plant material was added with 10 milliliter of the acetic acid and the mixtures were percolated overnight or for 24 hours. The mixtures were then filtered. The corresponding filtrates were diluted to 1% concentration as coating solutions.',NULL,NULL,'Region 8',NULL,2016,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(126,'2021-08-27 05:57:36','2021-11-03 04:34:48','Generally Regarded as Safe  (GRAS) Coatings (Natural Coating from Aquaeous Averrhoa carambola L.)','The present utility model is a composition of natural coating from aqueous starfruit (Averrhoa carambola L) leaf extract comprising of 50 grams Averrhoa carambola L. leaves and 5 liters distilled water. It was tested that the natural coating extended the shelf life of fresh vegetables particularly tomatoes and string beans. The process of producing the natural coating consist of cutting or slicing the leaves of the starfruit into small pieces and percolated separately with distilled water, ethanol, and acetic acid as extractants. Every gram of the plant material was added with 10 milliliter of the solvent and the mixtures were percolated overnight or for 24 hours. The mixtures were then filtered. The corresponding filtrates were diluted to 1% concentration as coating solutions.',NULL,NULL,'Region 8',NULL,2016,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(127,'2021-08-27 06:00:38','2021-11-03 04:34:55','Generally Regarded as Safe  (GRAS) Coatings (Natural Coating Composition from Acetic Acid Averrhoa carambola L.)','Improve the post harvest shelf-life of vegetables in Eastern Visayas through the utilization of “GRAS” coatings for harvested vegetables',NULL,NULL,'Region 8',NULL,2016,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(128,'2021-08-27 06:03:23','2021-11-03 04:34:59','Trichoderma Microbial Inoculant (TMI)','TMI is used to control crop plant diseases caused by soil-borne fungal pathogens. It also serves as a biofertilizer, which digests and decomposes soil organic matter and releases mineral nutrients needed for the promotion of crop growth.',NULL,NULL,'Region 4A',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(129,'2021-08-27 06:13:36','2021-11-03 04:35:04','Carrageenan Plant Growth Promoter','Carrageenan is an indigestible polysaccharide (carbohydrates) extracted from edible seaweeds.  Polysaccharide, when subjected to modified irradiation technology, can be an effective plant growth supplement. At a very small dose, this supplement makes an effective organic fertilizer.  It has been found to increase rice yield by 15-30%. The application of three and six bags of chemical fertilizer per ha, combined with 20 ml/L of carrageenan yields higher grain weight (450g and 455 g/10 hills, respectively) than the farmers\' practice of applying nine bags of chemical fertilizer/ha.  Carrageenan enhances the crop vigor of rice. Productive tillers and panicle length (length of inflorescence) are significantly higher in Carrageenan-treated plants. Productive tillers are the rice stems that bear panicles (rice inflorescence) with fertilized grains, while longer rice panicle is associated with producing more grains.',NULL,NULL,'Region 11',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(130,'2021-08-27 06:39:36','2021-11-03 04:35:10','Carrageenan Plant Growth Promoter','Carrageenan is an indigestible polysaccharide (carbohydrates) extracted from edible seaweeds.  Polysaccharide, when subjected to modified irradiation technology, can be an effective plant growth supplement. At a very small dose, this supplement makes an effective organic fertilizer.  It has been found to increase rice yield by 15-30%. The application of three and six bags of chemical fertilizer per ha, combined with 20 ml/L of carrageenan yields higher grain weight (450g and 455 g/10 hills, respectively) than the farmers\' practice of applying nine bags of chemical fertilizer/ha.  Carrageenan enhances the crop vigor of rice. Productive tillers and panicle length (length of inflorescence) are significantly higher in Carrageenan-treated plants. Productive tillers are the rice stems that bear panicles (rice inflorescence) with fertilized grains, while longer rice panicle is associated with producing more grains.',NULL,NULL,'Region 6',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(131,'2021-08-27 06:41:38','2021-11-03 04:35:14','Pelletizing Machine for Goat Feeds (Forage-Based Pellets for Dairy Goat)','A portable pellet mill developed mainly from scrap-materials that is appropriate for on-farm pellet production.  It is used in pelletizing total mixed ration (TMR) for goats.  It has a milling capacity of 130 kg/hr and machine efficiency of 93.30% with fuel consumption of 0.17 li/hr.',NULL,NULL,'Region 3',NULL,2009,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Field testing','Testing and Evaluation of Machinery Generated from PCAARRD-funded Projects','DOST-PCAARRD','University of the Philippines Los Baños',3305897.00,'2017-06-16','2019-05-15',NULL,NULL,NULL),(132,'2021-08-27 06:47:56','2021-11-03 04:35:20','SFEED Forage-based Pellet Feeds for Goat','Pellet feeds are bite-size pieces of sundried compressed nutritionally-balanced mixture of forage and grain ingredients such as ipil-ipil, rice bran, copra and molasses.',NULL,NULL,'Region 3',NULL,2015,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(133,'2021-08-27 06:53:27','2021-11-03 04:35:26','FertigroeTM Controlled-Release Fertilizer','Controlled-release nitrogen fertilizer (CRNF) aims to replace conventional fertilizer and to reduce the cost of farming. The technology utilized the inherent properties of nanofertilizer, such as controlled release of nitrogen and greater surface area for higher absorption rate. Since CRNF can fully replace conventional fertilizers, the input cost of farming can be minimized. Reduced amount in comparison with conventional fertilizers (up to 50% reduction) will be needed to acquire targeted plant development when CRNF is used.',NULL,NULL,'Region 4A',NULL,NULL,0,1,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(134,'2021-08-27 06:59:00','2021-11-03 04:35:32','Mechanical Peanut Stripper and Sorter','The peanut stripper with pod sorter machine is used to separate the peanut pods from the vines, removing the dust, stacks and foreign materials, and sort the pods into three sizes. It has a capacity of 117 kg/h depending on the pod/vine ratio and or the variety and season of harvesting.',NULL,NULL,'Region 2',NULL,2017,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(135,'2021-08-27 07:01:35','2021-11-05 00:01:42','Mechanical Peanut Sheller-Sorter','A peanut sheller with sorter machine to separate the peanut kernel from pods and sort the kernels into three sizes. It has a capacity of 150 kg/h with an overall shelling performance that is above the standard set by the PAES (Philippine Agricultural Engineering Standards).',NULL,NULL,'Region 2',NULL,2017,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(136,'2021-08-27 07:05:11','2021-11-05 00:01:53','Chevon Valley Canned Products (Kalderetang Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(137,'2021-08-27 07:09:13','2021-11-05 00:01:57','Chevon Valley Canned Products (Adobong Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(138,'2021-08-27 07:15:52','2021-11-05 00:02:02','Chevon Valley Canned Products (Kilawing Kambing)','Canned chevon products comes in three different recipes namely, Kalderetang Kambing, Adobong Kambing and Kilawing Kambing. Canning of local delicacies is a way of promoting native dishes and consequently, capturing the bigger market for chevon. It also ensures longer storage and stability of the product and easy transport.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,'612891f2359cfChevon.PNG'),(139,'2021-10-19 03:47:51','2021-11-05 00:02:06','Chevon Products in Retort Pouch (Sinampalukan)','Chevon food products, namely, pinapaitan, sinampalukan, chevon bulgogi and sisig, are packed in retortable stand up pouches, processed through water retort.',NULL,NULL,'Region 1',NULL,NULL,0,0,10,2,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(140,'2021-10-19 04:13:37','2021-10-19 04:13:37','Chevon Products in Retort Pouch (Pinapaitan)','Chevon food products, namely, pinapaitan, sinampalukan, chevon bulgogi and sisig, are packed in retortable stand up pouches, processed through water retort.',NULL,NULL,'Region 1',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(141,'2021-10-19 04:17:11','2021-10-19 04:26:14','HiYeast Biocontrol Agent for Fruits and Vegetables','HiYEAST is a yeast-based biocontrol agent  that prevents fruit and vegetable decay caused by pathogens during postharvest handling. The technology is designed as an alternative and/or supplement to reduce the use of chemicals in nature. Consequently, it will reduce human health and environmental risks that comes with the use of existing synthetic control agents. It is applicable to fruits and vegetables, specifically, to banana, tomato, calamansi, mango, garlic, nuts and onion.',NULL,NULL,'NCR',NULL,NULL,0,1,10,0,NULL,'Project 6. Yeast Application for Biocontrol of Postharvest Pathogens of Fruits and Vegetables','DOST','University of the Philippines Los Baños',941800.00,'2012-06-01','2015-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(142,'2021-10-19 04:35:21','2021-10-19 04:43:00','Juan Algae Microalgal Paste (Method and Composition of Microalgae Paste)','Algae pastes are concentrates of liquid microalgae cells which are used in nurseries as feed for larval fish, shrimp and other aquaculture species. The microalgae paste is an instant feed that can be used as an alternative to on-site algal culture especially when rations of live algae are insufficient. It is easy to apply and can be provided to the stock anytime.',NULL,NULL,'NCR',NULL,NULL,0,1,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Project 1. Pilot-testing of microalgae paste as feed for shrimp and milkfish hatcheries','PCAARD-GIA','University of the Philippines Visayas-College of Fisheries and Ocean Sciences (UPV-CFOS)',4170088.00,'2017-07-01','2018-06-30',NULL,NULL,NULL),(143,'2021-10-19 04:45:28','2021-10-19 04:56:59','\"Ride-on Precision Seeder for Wet Direct Seeding (Old name: Riding-type, self propelled rice seeder)\"','The machine is a local 8-row riding-type precision seeder that can have a seeding rate of 15kg/ha to 30 kg/ha and at least 2 ha/day field capacity and suitable both for hybrid and inbred rice production.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,0,NULL,'Project 1. Development of a locally adapted and manufactured riding type precision seeder','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice)',2844013.00,'2013-07-01','2014-06-30','Pilot testing','Pilot Testing of a Locally Manufactured Riding-type Precision Seeder','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice)',0.00,NULL,NULL,NULL,NULL,NULL),(144,'2021-10-19 04:59:15','2021-10-19 05:06:18','JAmp© Juan Amplification WSSV Detection Kit (Old name: LAMP Kit for Shrimp Pathogens)','Loop-Mediated Isothermal Amplification (LAMP) diagnostic kit is a practical alternative to the conventional polymerase chain reaction (PCR) and standard microbiological techniques in the detection of White Spot Syndrome Virus (WSSV). It is 10x more sensitive for the detection of WSSV compared to PCR. It is aided by a heat block apparatus which replaces the expensive thermal cycler. Results can also be obtained within 1 hour. Due to its convenience, simplicity and speed of detection, it can be used on-site. Diagnostic kit utilizing locally fabricated machine will significantly bring down the cost of pathogen detection in the country.',NULL,NULL,'NCR',NULL,NULL,0,1,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Project 6. Technology Transfer and Adoption of LAMP Assay to Shrimp Farmers','DOST-PCAARRD','University of Sto. Tomas',5842779.00,'2014-10-01','2016-12-31',NULL,NULL,NULL),(145,'2021-10-19 05:07:22','2021-10-19 06:13:34','Biosensor Kit for Shrimp Pathogens (Target Optimization in Nucleic Acid Based lateral Flow Strip Biosensor (LFSB) Detection)','One of the keys to reducing the risk of diseases in shrimp is prevention and early detection. Affordable, rapid, and easy to use for diagnosis of pathogen for shrimps method that involves the use of genome-based lateral flow strip biosensor has been developed as a diagnostic platform for white spot syndrome virus (WSSV) and other shrimp pathogens. The test strips are field-ready, with an extraction and mobile device kit for first level screening of pathogens on site. Test strips may also be coupled with polymerase chain reaction (PCR) amplification of DNA extracts for faster and low level detection. The test strips may be multiplexed for simultaneous detection of more than one pathogen.  The use of mobile strip reader and an accompanying application (app) instantaneously allows the test results of the diagnostic strips to be fed into an on-line pathogen information resource and biosurveillance system.  The mobile strip reader will link the data captured by the app to the cloud server, which in turn is linked to a biosurveillance data center at the Southeast Asian Fisheries Development Center (SEAFDEC).',NULL,NULL,'NCR',NULL,NULL,0,1,10,0,NULL,'Project 3. Development of shrimp pathogen diagnostic tools using nested PCR and lateral flow strip biosensors with mobile app and cloud-based information management','DOST-PCAARRD','Ateneo de Manila University',15436281.49,'2013-11-16','2015-12-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(146,'2021-10-19 06:14:37','2021-10-19 06:20:55','Biosensor Kit for Shrimp Pathogens (Lateral Flow Strip Biosensor (LFSB) Signal Amplification in Nucleic Acid Based Detection)','One of the keys to reducing the risk of diseases in shrimp is prevention and early detection. Affordable, rapid, and easy to use for diagnosis of pathogen for shrimps method that involves the use of genome-based lateral flow strip biosensor has been developed as a diagnostic platform for white spot syndrome virus (WSSV) and other shrimp pathogens. The test strips are field-ready, with an extraction and mobile device kit for first level screening of pathogens on site. Test strips may also be coupled with polymerase chain reaction (PCR) amplification of DNA extracts for faster and low level detection. The test strips may be multiplexed for simultaneous detection of more than one pathogen.  The use of mobile strip reader and an accompanying application (app) instantaneously allows the test results of the diagnostic strips to be fed into an on-line pathogen information resource and biosurveillance system.  The mobile strip reader will link the data captured by the app to the cloud server, which in turn is linked to a biosurveillance data center at the Southeast Asian Fisheries Development Center (SEAFDEC).',NULL,NULL,'NCR',NULL,NULL,0,1,10,0,NULL,'Project 3. Development of shrimp pathogen diagnostic tools using nested PCR and lateral flow strip biosensors with mobile app and cloud-based information management','DOST-PCAARRD','Ateneo de Manila University',15436281.49,'2013-11-16','2015-12-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(147,'2021-11-08 02:37:05','2021-11-08 02:59:43','Local Riding-type Rice Transplanter','Suitable for transplanting inbred and hybrid rice. It can transplant 2 to 6 seedlings per hill at a planting depth of 2-6 cm, hill spacing of 12-18 cm, and row spacing of 30 cm. Helps minimize labor cost compared to manual transplanting, which requires 20-25 persons/day/ha and takes only two persons to complete transplanting activities and has a planting capacity of 2 ha/day with 24 hills/m2 planting density.',NULL,NULL,'Region 3',NULL,2018,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Pilot Testing of Local Riding Type Transplanter','DOST-PCAARRD','Philippine Rice Research Institute (PhilRice) - Muñoz',4527613.00,'2016-11-01','2018-10-31',NULL,NULL,NULL),(148,'2021-11-08 03:08:58','2021-11-08 03:16:50','Sea Cucumber Dryer','A hybrid sea cucumber dryer comprising: a rectangular body having an upper member and a lower member. The said upper member of the hybrid sea cucumber dryer where drying is accomplished is mounted on top of the said lower member. The said upper member of the hybrid sea cucumber dryer comprising: a clear glass panel mounted on top of said upper member, a number of drying trays that easily slide into the tray holders, two vertical partitions that divide the said upper member into three, a number of doors for each division and air shutters which are all secured to the said rectangular body. The said lower member of the hybrid sea cucumber dryer where the drying air is heated in the absence of solar radiation is provided with a heating plate secured at the top portion of said lower member, an opening being secured on one side of the lower member, an air vent and a peep hole being secured at the opening, and a chimney protruding upwardly from the back side of said lower member. Said hybrid sea cucumber dryer uses a rice hull stove as heat source but other combustible biomass materials like wood, charcoal, corn cobs, etc. can be used as alternative fuel source.',NULL,NULL,'Region 4A',NULL,2014,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(149,'2021-11-08 05:21:32','2021-11-08 06:50:04','MicroMix Biostimulant for Bell Pepper and Bitter Gourd','MicroMix contains biostimulant-producing microbes selectively obtained from different rhizospheres and optimally combined to perform at its best using DNA-based techniques. MicroMixBG is used for bitter gourd while MicroMixBP is used for bell pepper. When applied by seed coating, it enhances root system for better growth and increase yield by more than 15%.',NULL,NULL,'NCR',NULL,2016,0,1,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,'Pilot testing','Pilot Testing and Pre-commercialization Analysis of Micromix as Microbial Based Stimulants for Improved Productivity of Solanaceous (Bell Pepper) and Cucurbits (Bittergourd)','DOST-GIA','University of the Philippines Los Baños',4975606.80,'2020-01-15','2021-01-14',NULL,NULL,NULL),(150,'2021-11-09 03:28:13','2021-11-09 03:32:03','MicroMix Biostimulant for Bell Pepper and Bitter Gourd','MicroMix contains biostimulant-producing microbes selectively obtained from different rhizospheres and optimally combined to perform at its best using DNA-based techniques. MicroMixBG is used for bitter gourd while MicroMixBP is used for bell pepper. When applied by seed coating, it enhances root system for better growth and increase yield by more than 15%.',NULL,NULL,'NCR',NULL,2016,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(151,'2021-11-09 03:34:48','2021-11-11 02:04:10','BioGreen Plus (Kakawate (Gliricidia sepium)-based Microbial Inoculant)','BioGreen is a processed compost enriched with beneficial microbial inoculants. In producing Bio-Green, inoculants of cellulolytic fungi and nitrogen-fixing bacteria are added before and after composting. After maturation, the inoculated compost is humified, stabilized and sanitized. The quality bio-organic fertilizer is proven to improve crop growth and yield. Depending on the soil type, BioGreen applied at 10-20 bags/ha can equal the effects of chemical fertilizers applied at a rate of 60-30-30. In combination with half dosage of chemical fertilizer, BioGreen can give superior yields.',NULL,NULL,'Region 4A',NULL,2017,0,1,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(153,'2021-11-11 02:06:03','2021-11-11 02:15:11','WiltCure™ Biopesticide','WiltCure, a biopesticide, can effectively control Fusarium wilt in tomato, eggplant, and hot pepper, resulting in more vigorous growth and higher yield.',NULL,NULL,'Region 4A',NULL,2015,0,1,10,0,NULL,'Callus and Microbe Co-culture as a Novel Source of Biopesticides against Major Agricultural Pests and Diseases','DOST-GIA','University of the Philippines Los Baños',1291900.00,'2012-01-07','2015-05-31',NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(154,'2021-11-11 03:02:50','2021-11-11 03:02:50','Mangrove crab soft shell production','Scylla spp. Juveniles (crablets) are obtained from hatcheries and reared in net cages until 3-4 cm size and grown further in ponds for 1.5-2.0 months until they attain 60-100g body weight. At this size, crabs are placed individually in perforated plastic boxes on pvc floating platforms set in brackish water ponds. The crabs are fed with mollusk or low value fish every two days. Molting is monitored every four hours. Newly molded crabs are kept in aerated freshwater to prevent hardening of shell. After one hour, the soft-shelled crabs are sorted and packed in plastic food containers for freezing.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(155,'2021-11-11 03:26:28','2021-11-11 03:26:28','Milkfish broodstock management and fry production in tanks','Potential milkfish breeders are grown in earthen ponds and marine net cages, attaining 0.5-3 kg each. Breeders are later reared in concrete tanks until they reach sexual maturity at 5-6 years of age. To rear breeders in tanks, stocking should be done before the start of the breeding season to condition them for spawning in captivity and improve their assimilation  of feeds. A stocking density of 1 kg per cubic meter or 1-2 fish per square meter is recommended. Strong aeration should be provided to prevent oxygen depletion. A flow through system is set up to drain and replenish the water daily at a rate of 100-200% of the tank volume. The spawners are fed with formulated diet containing 37% protein and 8% lipid at 3-4% of the fish biomass per day.',NULL,NULL,'Region 6',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(156,'2021-11-11 03:54:27','2021-11-11 03:54:27','Seaweed (Gracilaria) production using net modules','The module  improves the production and yield of gracilaria which consists of the following: polyethylene net with #12 mesh size, polyethylene rope, oyster shells and twine. The polyethylene net  used has â ½ mesh size and cut into 20 centimeters by ten meters. The long axis is sewn together to enclose oyster shells. Series of these nets are then brought to the culture area and are anchored with stakes at both ends. Along the nets are several stakes to keep the net above the seabed. Suitable sites must have at least 20 centimeters of water left at low tide for this proposed methodology. When the nets are already fixed, insertion of mature fronds or portion of the plants follows.',NULL,NULL,'Region 1',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(157,'2021-11-12 03:11:01','2021-11-12 03:11:01','Triangular method of seaweed farming','Modified triangular method of seaweed farming was derived from the innovative form of the traditional practice known as mono/multiple floating longline method, designed in deeper waters and is flexible enough to withstand strong winds and big waves.  The technology can also be applied in coastal communities with farm sites located in five (5) to ten (10) meters depth with a current speed of 20-40 meters per minute.  The aquaculture system is most efficient in terms of harvest volume and cost of production compared with other methods.  The technology can accommodate twenty (20) seedlings per triangle or 150,000 - 180,000 seedlings per hectare, a rate which is double compared to other methods.',NULL,NULL,'Region 1',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(158,'2021-11-12 03:25:21','2021-11-12 03:25:21','Nursery and pond management for shrimp (Ulang) production','The intervention applied by the new technology on the culture of ulang in ponds follows the rearing in the nursery of post larva before stocking, sorting for growing in the hatchery and sorting during harvest.',NULL,NULL,'Region 4A',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(159,'2021-11-12 03:40:56','2021-11-12 03:40:56','Sorting method during harvesting of ulang','The sorting method is done when the pl is about 3 months old and be stocked separately in different pond compartments by size to allow the small ones to utilize the inputs for them to grow faster to marketable size and variation in size will be prevented.',NULL,NULL,'Region 4A',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(160,'2021-11-12 03:44:36','2021-11-12 03:44:36','Use of FAST (freshwater aquaculture center selected tilapia) lines in tilapia production','The FAST (a.k.a. IDRC) genetic material was developed from 1986 to 1996 as an International Development Research Center (IDRC) supported tilapia project at the Freshwater Aquaculture Center of the Central Luzon State University. This strain came from a base population of four-strain group namely Israel, Singapore, Taiwan and Philippine nile tilapia strain, a product of 12 generations of selection of best individuals within a family. To date, the FAST lines are now on its 31st generation of selection. The FAST was developed using a within family selection with rotational mating scheme. Its response to selection was estimated at 18% compared to the previous generation of selection (Bolivar and Newkirk, 2002).',NULL,NULL,'Region 3',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(161,'2021-11-12 03:51:09','2021-11-12 03:51:09','\"FAST and EXCEL tilapia strains  Cage culture system\"','The technology involves a recommended package of technologies for tilapia grow-out operations in ponds, which includes the use of FAST and EXCEL tilapia strains, improved feed management practices, and culture system.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(162,'2021-11-12 03:56:53','2021-11-12 03:56:53','FAST and EXCEL tilapia strains in pond culture','The technology involves a recommended package of technologies for tilapia grow-out operations in ponds, which includes the use of FAST and EXCEL tilapia strains, improved feed management practices, and culture system.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL),(163,'2021-11-19 02:53:48','2021-11-19 02:53:48','Use of aquashade for tilapia production','The technology refers to the use of net (with the capacity to block 40% of sun rays) for shading was to reduce water temperature by more than 3°C during the hottest period of the day resulting to increased spawning rate and seed production by more than 100% in both seed production systems.',NULL,NULL,'Region 3',NULL,NULL,0,0,10,0,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL,NULL,0.00,NULL,NULL,NULL,NULL,NULL);
