INSERT INTO `user_messages` VALUES (2,'2021-08-07 08:36:48','2021-11-09 08:35:31','Anthonytew','no.reply.feedbackform@gmail.com',2,'Hi!  aanr.ph \r\n \r\nDid yоu knоw thаt it is pоssiblе tо sеnd аppеаl whоlly lеgit? \r\nWе prоviding а nеw uniquе wаy оf sеnding соmmеrсiаl оffеr thrоugh fееdbасk fоrms. Suсh fоrms аrе lосаtеd оn mаny sitеs. \r\nWhеn suсh rеquеsts аrе sеnt, nо pеrsоnаl dаtа is usеd, аnd mеssаgеs аrе sеnt tо fоrms spесifiсаlly dеsignеd tо rесеivе mеssаgеs аnd аppеаls. \r\nаlsо, mеssаgеs sеnt thrоugh fееdbасk Fоrms dо nоt gеt intо spаm bесаusе suсh mеssаgеs аrе соnsidеrеd impоrtаnt. \r\nWе оffеr yоu tо tеst оur sеrviсе fоr frее. Wе will sеnd up tо 50,000 mеssаgеs fоr yоu. \r\nThе соst оf sеnding оnе milliоn mеssаgеs is 49 USD. \r\n \r\nThis оffеr is сrеаtеd аutоmаtiсаlly. Plеаsе usе thе соntасt dеtаils bеlоw tо соntасt us. \r\n \r\nContact us. \r\nTelegram - @FeedbackFormEU \r\nSkype  live:.cid.eef97f1d29d827b5 \r\nWhatsApp - +375259112693',2),(3,'2021-08-17 14:30:08','2021-08-17 14:30:08','Sambo Dasuki','mmxx0684@gmail.com',3,'Dear Partner; \r\n \r\nI came across your email contact on Database; Where i was searching for a competent Partner who can handle a lucrative business for me as trustee and manager. I anticipate to read from you soon so I can provide you with more details. \r\n \r\nYours Sincerely, \r\nAlh. Sambo Dasuki \r\nmmxx0684@gmail.com',0),(4,'2021-08-18 21:33:33','2021-08-18 21:33:33','Michael Rajiv','michaelrajiv44@gmail.com',3,'Hello Dear, \r\n \r\nGreetings to you and I hope this email meet at your best, I am working directly with a private family portfolio that can provide funding for credible clients with feasible projects. Currently, we have investment funds for viable projects. \r\n \r\nThey are interested in the following: Institution, Library, Hospitals, Green energy, \r\nPower projects, Agriculture and Real Estate. They can also partner with your company on other projects of value. The interest rate and tenure are fantastic. \r\n \r\nYour response is most anticipated if this is of interest to you. \r\nReach me on email: funding@euroclearpayments.com or michaelrajiv44@gmail.com \r\n \r\n \r\nKind regards, \r\n \r\nMichael Rajiv \r\nFinancial Consultant \r\nCall: +44 7452 111119 \r\nEuroclear Groups \r\nfunding@euroclearpayments.com \r\nUrl: http://euroclear.com',0),(5,'2021-08-21 06:40:11','2021-08-21 06:40:11','Donald Cole','kendrickbells@donaldocole.com',2,'Good day \r\n \r\n \r\n \r\nI`m seeking a reputable company/individual to partner with in a manner that would benefit both parties. The project is worth $24 Million so \r\nIf interested, kindly contact me through this email donaldcole@donaldocole.com for clarification. \r\n \r\n \r\nI await your response. \r\n \r\n \r\nThanks, \r\n \r\n \r\nDonald Cole',0),(8,'2021-11-16 21:31:15','2021-11-16 21:31:15','Olivia Pointon','avaolivia2747@gmail.com',1,'Hi,\r\n\r\nWe\'d like to introduce to you our explainer video service which we feel can benefit your site aanr.ph.\r\n\r\nCheck out some of our existing videos here:\r\nhttps://www.youtube.com/watch?v=zvGF7uRfH04\r\nhttps://www.youtube.com/watch?v=cZPsp217Iik\r\nhttps://www.youtube.com/watch?v=JHfnqS2zpU8\r\n\r\nAll of our videos are in a similar animated format as the above examples and we have voice over artists with US/UK/Australian accents.\r\n\r\nThey can show a solution to a problem or simply promote one of your products or services. They are concise, can be uploaded to video such as Youtube, and can be embedded into your website or featured on landing pages.\r\n\r\nOur prices are as follows depending on video length:\r\n1 minute = $239\r\n1-2 minutes = $339\r\n2-3 minutes = $449\r\n\r\n*All prices above are in USD and include an engaging, and captivating video, full script and voice-over.\r\n\r\nIf this is something you would like to discuss further, don\'t hesitate to get in touch.\r\nIf you are not interested, simply delete this message and we won\'t contact you again.\r\n\r\nKind Regards,\r\nOlivia',0);
